(1, 1, 1, 'Oficjalna koszulka promująca projekt Kamil Lanek - EXTRAVAGANZA.\nNadruk wykonany metodą sitodruku.Gramatura 220g100% najlepszej jakości bawełna.Wyprodukowane w Polsce.\n\n\n\n \nRozmiar\n\n\n \nS\nM\nL\nXL\nXXL\n\n\n\n\nDługość całkowita\n70\n72\n74\n76\n78\n\n\nSzerokość pod pachami\n60\n62\n64\n66\n68', '', 't-shirt-lanek-extravaganza-black', '', '', '', 'T-shirt Lanek EXTRAVAGANZA Black', '', '', '', ''),
(2, 1, 1, 'Oficjalny merch trasy Nowy Idol Tour\nNadruk wykonany metodą sitodruku.100&amp; najlepsze jakości bawełna.Wyprodukowano w Polsce.\n\n\n\n \nRozmiar\n\n\n \nS\nM\nL\nXL\nXXL\n\n\n\n\nDługość całkowita\n70\n72\n74\n76\n79\n\n\nSzerokość pod pachami\n60\n62\n65\n67\n69\n\n\n\n ', '', 't-shirt-janusz-koszulczuk-nowy-idol-tour-white', '', '', '', 'T-shirt Janusz Koszulczuk - Nowy Idol Tour White', '', '', '', ''),
(3, 1, 1, 'Oficjalna koszulka projektu “Palma na blokach” od Beteo. Krój oversize, 100% bawełna. Za projekt odpowiada Stasiek Zieliński. Widzimy się na bloku.\n\n\n\n \nRozmiar\n\n\n \nS\nM\nL\nXL\n\n\n\n\nDługość całkowita\n74\n76\n78\n80\n\n\nSzerokość pod pachami\n62\n64\n68\n70', '', 't-shirt-pnb-white', '', '', '', 'T-shirt PNB White', '', '', '', ''),
(4, 1, 1, ' \nOficjalna bluza \'\'Palma na blokach\'\' by @podwrko od Beteo. Krój oversize, 100% bawełna. Za projekt odpowiada Stasiek Zieliński. Widzimy się na bloku.\n\n\n\n \nRozmiar\n\n\n \nS\nM\nL\nXL\nXXL\n\n\n\n\nDługość całkowita\n 73\n75\n77\n79 \n81 \n\n\nDługość rękawa mierzona od wszycia\n 80\n82\n85 \n87 \n90 \n\n\nSzerokość pod pachami\n 63\n65\n67 \n69 \n71 \n\n\n\n ', '', 'hoodie-pnb-black', '', '', '', 'Hoodie PNB Black', '', '', '', ''),
(5, 1, 1, ' \nOficjalna koszulka promująca projekt “Pretty Boy” White’a 2115.\nT-shirt o kroju oversize.Nadruki wykonane metodą sitodruku.100% najlepszej jakości bawełna, gramatura 185gWyprodukowane w Polsce.\n \n\n\n\n \nRozmiar\n\n\n \nS\nM\nL\nXL\n\n\n\n\nDługość całkowita\n74\n76\n78\n80\n\n\nSzerokość pod pachami\n62\n64\n68\n70\n\n\n\n ', '', 't-shirt-white-2115-pretty-boy-white', '', '', '', 'T-shirt White 2115 Pretty Boy White', '', '', '', ''),
(6, 1, 1, 'Klasyczna czarna bluza z kapturem.Z przodu nadruk wykonany metodą sitodruku. Na dole metka żakardowa.95% bawełna, 5% poliester. Wyprodukowana w Polsce.\nRozmiarXSSMLXLXXLDługość całkowita606871767983Długość rękawa mierzona od ramienia6156,558606364Szerokość pod pachami54,55960,562,56467,5', '', 'hoodie-big-logo-black', '', '', '', 'Hoodie Big logo Black', '', '', '', ''),
(7, 1, 1, 'Klasyczna biała bluza z kapturem.Z przodu nadruk wykonany metodą sitodruku.Na dole metka żakardowa.95% bawełna, 5 % poliesterWyprodukowane w Polsce\nRozmiarSMLXLXXLDługość całkowita6871767983Długość rękawa mierzona od ramienia56,558606364Szerokość pod pachami5960,562,56467,5', '', 'hoodie-big-logo-white', '', '', '', 'Hoodie Big Logo White', '', '', '', ''),
(8, 1, 1, 'Klasyczna koszulka SB Maffija.Z przodu nadruk wykonany metodą sitodruku.Na dole metka żakardowa.100% najlepszej jakości bawełna.Wyprodukowane w Polsce.\nRozmiarSMLXLXXLDługość całkowita7275798285Szerokość pod pachami5052555860', '', 't-shirt-sb-maffija-big-logo-black', '', '', '', 'T-shirt SB Maffija Big Logo Black', '', '', '', ''),
(9, 1, 1, 'Biała koszulka SB Maffija.T-shirt o klasycznym kroju.Z przodu nadruk wykonany metodą sitodruku.Na dole metka żakardowa.100% najlepszej jakości bawełna.Wyprodukowane w Polsce.\nRozmiarSMLXLXXLDługość całkowita7275798285Szerokość pod pachami5052555860', '', 't-shirt-sb-maffija-big-logo-white', '', '', '', 'T-shirt SB Maffija Big Logo White', '', '', '', ''),
