(52, 1, 1, 'Czarna kurtka wiatrówka wkładana przez głowę.Nadruk wykonany metodą sublimacji.Kaptur z regulowanym ściągaczem.Dwie kieszenie zapinane na suwak.Pod szyją i w lewym boku również suwaki.W karku metka żakardowa.Podszewka wykonana z czarnej satyny.Użyty materiał to mikropoliester.Wyprodukowane w Polsce.', '', 'windbreaker-printed-black', '', '', '', 'Windbreaker Printed Black', '', '', '', ''),
