(56, 1, 1, 'Czarny miejski plecak.\nGłówna komora zapinana na zamek błyskawiczny i dodatkowo zawijana, a następnie zapinana na zatrzask.\nW środku dodatkowa mniejsza przegroda.\nZ przodu haftowana naszywka.\nWyprodukowany w Polsce.Wymiary: 32x44x13 cm, ok. 20 litrów; możliwość umieszczenia laptopa max 15,6\"', '', 'backpack-city-black', '', '', '', 'Backpack City Black', '', '', '', ''),
