(61, 1, 1, 'Maseczka higieniczna wielokrotnego użytku.Maseczkę można prać i prasować.\nTen produkt nie jest chirurgiczną ani oddechową maską, ani też osobistym czy medycznym wyposażeniem ochronnym. Jest to produkt wyłącznie do użytku prywatnego i nie nadaje się do użytku medycznego ani do zapewnienia bezpieczeństwa pracy. Produkt nie chroni przed infekcjami. W przypadku zakupu tego produktu nie obowiązuje polityka zwrotów. Ustawowe prawa pozostają takie same.', '', 'mask-sbm-white', '', '', '', 'Mask SBM White', '', '', '', ''),
