(65, 1, 1, ' \nWraz z \"Wiatrem wielkich zmian\" w karierze Lanka rozpoczął się nowy etap. Znany do tej pory głównie ze światowej klasy produkcji, Kamil Lanek zaprezentował solowy singiel, który zanotował milionowe wyświetlenia i przygotował grunt pod jego nadchodzący album.  Po ponad roku prac nareszcie może przedstawić swoje najnowsze dzieło zatytułowane \"EXTRAVAGANZA\". Płyta składa się z czternastu utworów, na których wokalnie udzielił się nie tylko Kamil, ale również wyjątkowi goście.\n \nAutorem okładki jest Bartłomiej Chwilczyński, a za poligrafię odpowiada Tomasz Kudlak.\n \nTRACKLISTA:\n0. 4/20211. EXTRAVAGANZA2. POWIEMY CI TO W TWARZ3. BAKTERIA4. AFRYKA5. 5K6. NOWY ŚWIAT7. ŚWIĘCI SĄ NIESPRAWIEDLIWI8. ZEMSTA DZIKUSA9. UPIÓR10. MILION GWIAZD11. CUDI12. GŁOŚNO JAK STU13. OBOK TY\n ', '', 'kamil-lanek-extravaganza-standard', '', '', '', 'Kamil Lanek - EXTRAVAGANZA (standard)', '', '', '', ''),
(66, 1, 1, ' \n \nStandardowe wydanie nadchodzącego albumu Jana-Rapowanie \"Bufor\" \n1. boję się2. POŻYJEMY ZOBACZYMY 3. ParabolA 4. b u f o r 5. LAXJFK 6. BIZNES 7. TRYB SAMOLOTOWY 8. ŁAWKA Z CHŁOPAKAMI 9. JESTEM STĄD 10. BRIEF 11. Klucze do Miasta 12. mały Świat 13. anioły 14. szkoda 15. spokójduchaimitacjązbroi', '', 'jan-rapowanie-bufor-standard', '', '', '', 'Jan-rapowanie - BUFOR (standard)', '', '', '', ''),
(67, 1, 1, ' \nPLANOWANA DATA WYSYŁKI: 15.01.2023\nZ okazji pierwszej rocznicy powstania przełomowego, drugiego albumu w dyskografii braci Kacperczyk w Wasze ręce może trafić jedna z 500 sztuk limitowanego nakładu winyli Kryzysu Wieku Wczesnego. Wydanie zawiera wszystkie utwory z wersji deluxe LP KWW.\nDostawy spodziewajcie się w styczniu nowego roku, a na czas oczekiwania przygotowaliśmy dokument z największej dotychczasowej trasy koncertowej zespołu, który znajdziecie na kanale SBM Label. Każdy z przyszłych, szczęśliwych posiadaczy wosku otrzyma produkt z unikalnym rozpryskiem w kolorze trans magenta, dzięki czemu wybrany winyl będzie jedyny w swoim rodzaju.\n \nStrona A:1. Kryzys Wieku Wczesnego\n2. Artysta z ASP\n3. Cyrk\n4. ANYWAY2005 (skit)\n5. Brejdaki\n6. Ludzie piękni\n7. WARSAWDAY2013 (skit)\n \nStrona B:\n1. Znudziło mi się\n2. Sebiksy\n3. Długi\n4. Ptaki (skit)\n5. Niebieskie ptaki\n6. Nie wiem, co jest dobre, a co złe\n7. Po co się smucić\n ', '', 'kacperczyk-kryzys-wieku-wczesnego', '', '', '', 'Kacperczyk - Kryzys Wieku Wczesnego', '', '', '', ''),
(68, 1, 1, 'DATA PREMIERY: 27.01.2023\nPLANOWANA DATA DOSTAWY: 26.01.2023\n \n WALCZUK BOX! Punktem wyjścia przy tym preorderze było skierowanie składu boxa dla najwierniejszych fanów. Wszystko, co w nim znajdziecie, czyli:\n\nJan Walczuk Deluxe z autografem,\nbonus CD,\nczapka z daszkiem (zajebista),\narkusz wlepek,\nlist od Janusza wraz z ekskluzywną rozmową przeprowadzoną przez Sworo,\nkartonowy Janusz (serio).\n\n \n \nJanusz Walczuk nazywa się Jan Walczuk. I od teraz to on jest Waszym nowym idolem. Za nami blisko dwa lata od premiery debiutanckiej płyty Jana, ówczesnego Janusza. Od tej pory zmieniło się wszystko, a przede wszystkim on sam. Drugi długogrający album Janusza Walczuka “JAN WALCZUK” ukaże się już 27 stycznia. \nYah00 w wieku 13 lat nagrał swój pierwszy utwór w NOBOCOTO Studio. Już wtedy wiedział, co chce osiągnąć i jak to zrobić. I nie, nie jest to ckliwa historia chłopaka z żoliborskich bloków. To opowieść o konsekwencji, niekwestionowanym sukcesie, miłości - tej do muzyki, jak i tej, którą znalazł na swej drodze. To też w końcu opowieść o otrzymanym wsparciu, braciach, pysze, hajsie i zazie - po prostu o życiu. \nNajbardziej zależy mu na muzyce, bo na niej zna się najlepiej i to jej zawdzięcza grono najwierniejszych fanów. Swoją osobowością i twórczością od początku wzbudzał skrajne emocje, i opinie - obok najwierniejszych fanów, poznał równie wiernych hejterów. JAN WALCZUK to koalescencja dotychczasowych doświadczeń, jako artysta, a więc osoba publiczna, z prywatnymi wydarzeniami i odczuciami, jakie wiążą się z tym statusem. Poznajcie zatem dwie strony medalu.\nAlbum jest efektem wielomiesięcznej pracy nad muzyką, jak i samym sobą. Usłyszycie na nim szereg polskich artystów i artystek. Towarzyszy temu inne, bardziej różnorodne podejście do współpracy z autorami muzyki. Mimo wielości stylów i bitów na każdym numerze znajdziemy indywidualną cząstkę Janusza, jego sznyt i ego. To płyta dopracowana w każdym detalu, stworzona z czystej potrzeby uzewnętrznienia się 24-latka, który jak mało kto doświadczył wzlotów i upadków kształtujących osobowość. Stworzona dla wszystkich i każdego z osobna.\n \nPremiera 27.01.2023\nAutorem zdjęcia okładkowego jest Oskar Szdzuij, a za oprawę graficzną odpowiada Małgorzata Pawińska\n \nArt Direction / 3D : Gonia Pawińska @gonia_ognia\nPhotographer: Oskar Szdzuj @oskarszdzuj\nPhotographer\'s Assistant: Tomasz Sagan @tomsagan\nMake-up Artist: Zosia Tadeusz @zofiatad\nCostume Stylist: Linda Golińska @lindagolinska\nPostproduction: Przemekysław Brzoskowski // parabolaposproduction @pbrzoskowski', '', 'walczuk-box', '', '', '', 'WALCZUK BOX', '', '', '', ''),
(69, 1, 1, ' \nDATA PREMIERY: 27.01.2023\nPLANOWANA DATA DOSTAWY: 26.01.2023\nDrugi długogrający album Janusza Walczuka JAN WALCZUK w wersji Deluxe zawiera Super Jewel Box zawierający dwie płyty: wydanie deluxe płyty oraz bonus CD z dodatkową muzyką. A dodatkowo wlepki, a każdy egzemplarz będzie osobiście podpisany przez artystę. \nJanusz Walczuk nazywa się Jan Walczuk. I od teraz to on jest Waszym nowym idolem. Za nami blisko dwa lata od premiery debiutanckiej płyty Jana, ówczesnego Janusza. Od tej pory zmieniło się wszystko, a przede wszystkim on sam. Drugi długogrający album Janusza Walczuka “JAN WALCZUK” ukaże się już 27 stycznia.\nYah00 w wieku 13 lat nagrał swój pierwszy utwór w NOBOCOTO Studio. Już wtedy wiedział, co chce osiągnąć i jak to zrobić. I nie, nie jest to ckliwa historia chłopaka z żoliborskich bloków. To opowieść o konsekwencji, niekwestionowanym sukcesie, miłości - tej do muzyki, jak i tej, którą znalazł na swej drodze. To też w końcu opowieść o otrzymanym wsparciu, braciach, pysze, hajsie i zazie - po prostu o życiu.\nNajbardziej zależy mu na muzyce, bo na niej zna się najlepiej i to jej zawdzięcza grono najwierniejszych fanów. Swoją osobowością i twórczością od początku wzbudzał skrajne emocje, i opinie - obok najwierniejszych fanów, poznał równie wiernych hejterów. JAN WALCZUK to koalescencja dotychczasowych doświadczeń, jako artysta, a więc osoba publiczna, z prywatnymi wydarzeniami i odczuciami, jakie wiążą się z tym statusem. Poznajcie zatem dwie strony medalu.\nAlbum jest efektem wielomiesięcznej pracy nad muzyką, jak i samym sobą. Usłyszycie na nim szereg polskich artystów i artystek. Towarzyszy temu inne, bardziej różnorodne podejście do współpracy z autorami muzyki. Mimo wielości stylów i bitów na każdym numerze znajdziemy indywidualną cząstkę Janusza, jego sznyt i ego. To płyta dopracowana w każdym detalu, stworzona z czystej potrzeby uzewnętrznienia się 24-latka, który jak mało kto doświadczył wzlotów i upadków kształtujących osobowość. Stworzona dla wszystkich i każdego z osobna.\nPremiera 27.01.2023\nAutorem zdjęcia okładkowego jest Oskar Szdzuij, a za oprawę graficzną odpowiada Małgorzata Pawińska\n \nArt Direction / 3D : Gonia Pawińska @gonia_ognia \nPhotographer: Oskar Szdzuj @oskarszdzuj \nPhotographer\'s Assistant: Tomasz Sagan @tomsagan \nMake-up Artist: Zosia Tadeusz @zofiatad \nCostume Stylist: Linda Golińska @lindagolinska \nPostproduction: Przemekysław Brzoskowski // parabolaposproduction @pbrzoskowski', '', 'janusz-walczuk-jan-walczuk-deluxe', '', '', '', 'Janusz Walczuk - Jan Walczuk (deluxe)', '', '', '', ''),
(70, 1, 1, 'Beteo wraca po dwóch latach od premiery ostatniego albumu z „Palmą na blokach”, najlepszym projektem, jaki dotychczas udało mu się stworzyć. Wersja deluxe płyty została rozszerzona o dodatkowe utwory, ale o tym w dzień premiery - już 30 września! Słyszymy się na bloku.\n \nProjekt okładki: Stasiek Zieliński ', '', 'beteo-palma-na-blokach-deluxe', '', '', '', 'Beteo - \'\'Palma na blokach\'\' (deluxe)', '', '', '', ''),
(71, 1, 1, 'Limitowane wydanie albumu “Młody Matczak” to winylowa wersja pokrytego poczwórną platyną najnowszego wydawnictwa Maty. Składają się na niego dwie błękitne winylowe płyty – barwa zgodna z identyfikacją graficzną znaną z wersji CD – oraz wyjątkowa poligrafia wykorzystująca niepublikowane nigdy wcześniej zdjęcia. Nakład wynosi równe 3333 egzemplarze, a produkcja wydania nigdy nie zostanie wznowiona.Autorem zdjęcia okładkowego jest Piotr Pytel.Za poligrafię odpowiedzialny jest Tomek Kudlak.', '', 'mata-mlody-matczak-2lp-deluxe', '', '', '', 'Mata - Młody Matczak (2LP Deluxe)', '', '', '', ''),
(72, 1, 1, 'Dzięki swoim trzem solowym płytom White 2115 zdecydowanie zasłużył na miano króla wakacji. Teraz jako Pretty Boy powraca po blisko dwóch latach od ostatniej części Rockstara, aby ponownie nadać brzmienie nadchodzącemu latu.\n Zdjęcie okładkowe: Paweł MiśkoArtwork: Tomek Kudlak\n ', '', 'white-2115-pretty-boy-standard', '', '', '', 'White 2115 - Pretty Boy (standard)', '', '', '', ''),
(73, 1, 1, 'Po sukcesie \"Rozmazanej kreski\" oraz tygodniowym pobycie w \"Hotelu Maffija 2\", Kinny Zimmer prezentuje swój debiutancki album pt. \"LETNISKO\". Młody harcerz znany m.in. ze swojego kapelusza oraz fioletowej chusty powraca w nowej odsłonie, która idealnie wpisuje się w klimat nadchodzącego lata. Spędźcie je razem z nami w \"LETNISKU\".\n \nTRACKLISTA:\n \n\nLato cały rok \nJazda \n200 osób w kawalerce \nZegarek ze Szwajcarii \nRozmazana kreska \nBierny420\nBenz-Dealer ft. Quebonafide \nDziecko\nJadę nocą na Mazurach 2 ft. Szpaku \nWCHJ\nJezioro ft. White 2115\nOstre koło ft. Jonasz z Badyru \nJestem kwiatkiem \nFURIA47 ft. OKI \nLetnisko Main Theme ', '', 'kinny-zimmer-letnisko-standard', '', '', '', 'Kinny Zimmer - \'\'LETNISKO\'\' (standard)', '', '', '', ''),
(74, 1, 1, 'Rewolucja Romantyczna” Bedoesa i Lanka ma już rok. Rocznicę świętujemy limitowanym, winylowym wydaniem utrzymanym w kolorystyce albumu. Drugi wspólny album Bedoesa i Lanka powstawał z dala od zgiełku i blichtru, w murach niewieścińskiego pałacu, gdzie obaj nabrali dystansu do otaczającego ich świata i zrozumieli go z innej perspektywy. Posłuchajcie tej podwójnie platynowej płyty na nowo!\n ', '', 'bedoes-lanek-rewolucja-romantyczna-2lp', '', '', '', 'Bedoes & Lanek - Rewolucja Romantyczna (2LP)', '', '', '', ''),
(75, 1, 1, 'DATA PREMIERY: 09.06.2021\nPRZEWIDYWANA DATA DOSTAWY: 08.06.2021\nFukaj jest bohaterem jednej z najszybciej rozwijających się karier w historii polskiej sceny rapowej. W ciągu zaledwie kilku miesięcy zwykły chłopak ze szczecińskich Gumieniec znalazł się w orbicie zainteresowania najpopularniejszych artystów i największych wytwórni, a jego ksywka elektryzuje słuchaczy jak kraj długi i szeroki. Swój debiutancki album “CHAOS”, który ukaże się pod szyldem SBM Label, stworzył we współpracy z Kubim Producentem. Ich dzieło, choć tytuł na to nie wskazuje, jest uporządkowane od początku do końca. \nCechą charakterystyczną chaosu jest to, że zawsze wyłania się z niego nowy, przeważnie lepszy świat. Wiedzieli o tym już starożytni Grecy i wie o tym także Fukaj, który własny chaos ma już za sobą, a wyniesione z niego przeżycia i doświadczenia uporządkował, a następnie zawarł w czternastu utworach debiutanckiego, opartego na koncepcie albumu. “CHAOS” przedstawia życiową i moralną przemianę głównego bohatera zainicjowaną przez trudne wydarzenie z nieodległej przeszłości. Do jej pełnego zrozumienia niezbędne jest przejście przez trzy etapy, które wyznaczają utwory znajdujące się na początku (“Oto jest dzień”), w środku (“Wstań i zaśnij”) oraz na końcu (“Dom Diabła”) albumu. Bohaterowi w przemianie towarzyszy tajemnicza kobieta, której głos ma zdecydowany wpływ na podejmowane przez niego decyzje, jednak jej rola pozostaje nieznana. Choć wędrówka bohatera dobiega końca, w jego głowie dalej kłębią się wątpliwości. Czy to, co powstało z tytułowego chaosu, jest dobre? Czym w ogóle jest dobro, a czym zło? Na to pytanie każdy musi znaleźć swoją odpowiedź.\nJedynym autorem muzyki jest Kubi Producent - jeden z najpopularniejszych polskich producentów, który mimo młodego wieku ma już na swoim koncie albumy stworzone w duetach z czołowymi postaciami rapowej sceny. Współpracował także z przedstawicielami innych gatunków muzycznych. Album współtworzony z Fukajem jest kolejnym dowodem na to, że Kubi to jeden z najbardziej wszechstronnych producentów w branży, a jego biegłość w kreowaniu eklektycznego i jednocześnie spójnego brzmienia rośnie z każdym projektem.\nWydanie preorderowe, oprócz albumu Fukaja i Kubiego Producenta “CHAOS” zawiera także film dokumentujący proces powstawania płyty. Autorem wydania fizycznego jest uznany polski projektant Mateusz Machalski. Premiera płyty zaplanowana jest na 9 czerwca. \nTracklista:\n1. chaos (intro)\n2. oto jest dzień\n3. nominacja\n4. ogród\n5. zatapiamy się feat. Vito Bambino \n6. Północ\n7. Wstań i Zaśnij\n8. Marvin Gaye\n9. Tańczę nim zasnę (co-prod. Charlie Moncler)\n10. Światła Miasta\n11. Bar Mleczny\n12. BÓL \n13. DOM DIABŁA\n14. ZIEMIA OBIECANA', '', 'fukaj-kubi-producent-chaos-standard', '', '', '', 'Fukaj & Kubi Producent - Chaos (standard)', '', '', '', ''),
(76, 1, 1, 'Choć \"Kryzys Wieku Wczesnego\" to druga długogrająca płyta braci Kacperczyk, chłopaki podeszli do niej jak do debiutanckiego krążka i po raz pierwszy pozwolili swoim słuchaczom zajrzeć za kurtynę i odkryć towarzyszące autorom nadzieje oraz obawy. Ukończenie studiów, wyprowadzka od rodziców, wyjście naprzeciw nieznanej przyszłości - wszystkie te czynniki sprawiły, że bracia na własnej skórze odczuli tytułowy kryzys. Swoje piętno odcisnął na nich również covidowy lockdown, który dodatkowo spotęgował uczucie tęsknoty za tym, co było oraz lęku przed tym, co nadejdzie. Bardzo często kryzys jest momentem przełomowym i nie inaczej było w tym przypadku.\n \n\"Kryzys Wieku Wczesnego\" to płyta o znalezieniu szczęścia oraz spokoju po trudnym okresie, który zakwestionował, wydawałoby się, poukładany do tej pory świat. Pokazuje również, że życie jest po prostu OK, a upadki spowodowane rozczarowaniami, używkami czy nawet brakiem planu dnia są naturalnymi poprzednikami oraz następcami tych najlepszych chwil.\n \n\"Po wielu nieudanych podejściach, napisaliśmy tę płytę w rok. Przez chwilę już sami nie widzieliśmy, kim jesteśmy, bo w końcu wcale nie tak łatwo muzykom alternatywnym odnaleźć się w rapowej wytwórni. Z czasem znaleźliśmy dla siebie miejsce w tym wszystkim i nagraliśmy szczerą płytę. Obcowanie z artystami z SBM sprawiło, że na tym krążku postawiliśmy mocny nacisk na tekst utworów.\" - tak o swojej płycie piszą jej autorzy.\n \nBracia Kacperczyk to niezmiennie samowystarczalny duet - za warstwę liryczną utworów odpowiada Maciek, podczas gdy Paweł zajmuje się ich produkcją i to właśnie fakt, że wspierają się na każdym kroku, czyni owoc ich współpracy wyjątkowym. Na ich drugim krążku znajdziemy gościnne zwrotki Julii Pośnik, Julii Wieniawy, Janusz Walczuka, CatchUpa i Hodaka.\n \nAutorem zdjęcia okładkowego jest Karolina Wojtas.\nZa poligrafię odpowiedzialny jest Tomek Kudlak\nAlbum trafi na półki sklepowe już 26 listopada.\n \nTRACKLISTA:\n\nKryzys Wieku Wczesnego\nArtysta z ASP\nCyrk feat. Hodak\nANYWAY2005 (skit)\nBrejdaki\nLudzie piękni feat. CatchUp, Janusz Walczuk\nWARSAWDAY2013 (skit)\nZnudziło mi się\nSebiksy feat. Julia Wieniawa\nDługi\nPtaki (skit)\nNiebieskie ptaki feat. Julia Pośnik\nNie wiem, co jest dobre, a co złe\nPo co się smucić', '', 'kacperczyk-kryzys-wieku-wczesnego-standard', '', '', '', 'Kacperczyk - Kryzys Wieku Wczesnego (standard)', '', '', '', ''),
(77, 1, 1, 'Standardowa wersja albumu \"Hotel Maffija 2\".Tracklista:\n\nParapetówa\nZa karę\nAgrest i bez\nco to za bluza lanek?\nDoba hotelowa\nDroga Pani\nZielona szkoła\nŚniadanie w hotelu\nWROOBEL DAJ TO GŁOŚNIEJ\nBania u Solara HiT\nChodzę po Luwrze\nPrometazyna\nŁyk i buch\nBaśnie braci Kacperczyk\nPancerz\nDo zobaczenia\nPostanowienia noworoczne\nSzansa na sukces\nLawenda\nWiatr wielkich zmian', '', 'sb-maffija-hotel-maffija-2-wersja-standard', '', '', '', 'SB Maffija - Hotel Maffija 2 (wersja standard)', '', '', '', ''),
(78, 1, 1, 'Z dala od zgiełku i blichtru, w murach niewieścińskiego pałacu Bedoes i Lanek nabrali dystansu do otaczającego ich świata i zrozumieli go z innej perspektywy. W nowej opowieści nie ma już baśniowych elementów. Rzeczywistość przytłacza jak nigdy wcześniej, euforia i rozpacz idą ze sobą w parze, a osiągnięte sukcesy napawają równie mocno radością, co lękiem. W skąpym świetle ulicy, gdzie wrogowie czają się na każdym kroku, można ufać tylko najbliższym przyjaciołom, których lojalność jest teraz szczególnie ważna. W podzielonym społeczeństwie wzbiera wściekłość i tylko stanowcza reakcja może powstrzymać jego postępujący upadek. Narastający bunt musi znaleźć ujście, ale nienawiść i zło trzeba zwyciężyć miłością. Stary ład kończy się na naszych oczach, a przyszłość jest w rękach tych, którzy wezmą odpowiedzialność za los pokolenia. Przyszedł czas na rewolucję.', '', 'bedoes-lanek-rewolucja-romantyczna-standard', '', '', '', 'Bedoes & Lanek - Rewolucja Romantyczna (standard)', '', '', '', ''),
(79, 1, 1, '1. KAKTUS 2. MOVIE RODZICOM, ŻE DZIŚ U KUMPELI ŚPI ft. Marie 3. PASSE ft. Czesław Śpiewa 4. TEDX ft. KęKę 5. GUPIA MAUPA ft. Diho 6. BRAVO 7. boyo skit łan ft. Piotr Reiss 8. BOYO 9. boyo skit tu ft. Piotr Reiss 10. PARTY U CHEERLEADEREK ft. White 2115 &amp; Białas 11. WIEM CO ĆPIEM ft. Mestosław &amp; Koza 12. PAPIEROSES 13. SŁÓJ NA PETY 14. KHALIFA 15. ŻULE W TAXI ft. Food Emperor &amp; Donguralesko 16. HESTIA ft. White 2115 17. ING &amp; YOUNG ft. Kuqe 2115 &amp; Dianka 18. CHO DO WUJA 19. ZCNM ft. Janusz Walczuk &amp; Sara Forte 20. ROXA ft. Wini 21. PROSZĘ WRÓĆ ;( 22. PAPA WIN! ft. Solar\nNa płycie gościnnie udzielili się: Białas, Czesław Śpiewa, DGE, Dianka, Diho, Janusz Walczuk, Koza, Kuqe 2115, Kękę, Marie, Mestosław, Piotr Reiss, Sara Forte, Solar, The Food Emperor, White 2115, Wini.\n ', '', 'adi-nowak-ognisko-niedomowe-standard', '', '', '', 'Adi Nowak - Ognisko Niedomowe (Standard)', '', '', '', ''),
(80, 1, 1, 'Zero. Nie czytasz.Siedem. Idziesz do szkoły. Trenujesz gałę. RównolegleTrochę słabsi rówieśnicy dają Ci odczuć, że jesteś w tym trochę dobry.Nie wiesz jeszcze co to ego. Ale rośnie.I Ty. Dorastasz trochę. Lubisz gałę.Gimbcia. Zły kolega pokazuje Ci jointa. Brat mu pokazał.Jaracie w piwnicy. BK duża, aż dynia boli.Co z tego? Nie wiesz. Co, gdyby nie? Też. Po co wiedzieć?Twój trener. Pewnie by gardził. Jest hardy.Pro jak żaden Ci znany. Dobry. Pedagog też. Ułożył Ci w głowie, co trzeba było. I w porę.Respekciuch dożywotni. Jeździł bajkiem. Wszędzie. Wzgląd na porę dnia? Roku? Brak.Dziwne. Ciekawe. Imponujące.Joinciuchy nadal. Wiadomo, że gimbcia, to też dupy. Niby jedna. Ale nie. Elo.LO.Fotki. Fejsy. Telefony. Atencja. Oj pusto. Rozumiesz? Co, że nie?Szukasz? Nie. Znajdujesz? Nie. Kogo? Czego? Kogo bardziej. Ale nie.Kaszlesz. Psikasz. Chory na życie. Zdradzasz. Chcesz lata. Cienia. Rzucać? Być?Rzucać. Chłód.Wszystko, co wadzi. Dużo tego. Teraz bardziej czego.Ego down.Chory? To herba. Z cytryną. Z gały nici.Masz hajs? Kwas. A barki? Pijesz? Nie? Bierzesz na nie robę.Nie lubisz, a masz. Rodzice? Nie lubisz, a masz.Nie kumasz, a pato.Bijcie się ciszej. Prośbunia. Rejestruję tu.Trochę czasu. Kraul. Procent. Pato nie mniejsze.Większe.Walczysz? Idziesz z torbami. Torby expa. Empty kejda.Przyjaciel przekima. Karmi chwilę. Znajdujesz szcześcian. Robota.Telemarketaketa. Jakoś trzymasz.Się.Pełna epa. Puszczasz. Zbierasz. Poznajesz.Poznany buli. Ty robisz. Pory dnia. Roku. Mijają.Hibernujesz.Się Tobie. Dużo. Hajs. Wafle. Wydaje.Wafle to wafle. Na. Łogi. Wyki. Pakmana.Lekkość. Ja. Kruchość. Wafle.Wafle. To Ludzie.U.Wiosna. W końcu. Dobra, wstaję_\nTrack lista:\n01. Ole / prod. En2ak02. Wielokropek / prod. En2ak03. Bajk / prod. En2ak04. Tinder (skit) / prod. AIST05. Kalesony / prod. kornel barwiński, Karol Szczygieł, klarnet: Kamil Leszczyński06. Miód i czosnek / prod. Lema07. Zielone migdały / prod. Moo Latte08. Mieszanka studencka (skit) / prod. AIST09. Porcelana / prod. En2ak10. Plaża na podłodze / prod. Lux Familiar11. Despoto mój / prod. Cry in Spanish / En2ak12. Chrzan (skit) / prod. AIST13. Sen Intro. / prod. Drumlinaz14. Vafle Ryżowe / prod. AIST15. Elon mózg / prod. AIST', '', 'adi-nowak-vafle-ryzowe', '', '', '', 'Adi Nowak - Vafle Ryżowe', '', '', '', ''),
(81, 1, 1, 'SB Maffija Label\nprezentuje długo oczekiwany album ADM-a \"Hellboy\".\nNa płycie znajduje się\n18 starannie wyselekcjonowanych tracków, które „napisało” szalone życie\nMateusza Adamowicza.\n- Płyta miała wyjść\ndawno temu, jednak różnie to w życiu bywa, tym bardziej w życiu połączony z\nmoim trybem egzystencji. Melanże, zawirowania, szpitale - zrobiły swoje. Na\nszczęście wszystko jest już dopięte na ostatni guzik i wypuszczamy ten album.\nDziękuje tym, którzy na to czekają i mnie wspierają wiadomościami oraz podczas\nrozmów. Jestem szczęśliwy z samego faktu ukazania się mojego albumu - lepiej\npóźno niż wcale! Wielokrotne obsuwy nie były wyrazem braku szacunku do\nsłuchaczy, tylko efektem poważnych zawirowań. Usłyszycie o nich na płycie,\nponieważ są kawałkiem mojego życia. Taki już jestem ja i moja muzyka. Myślę, że\npodczas odsłuchu nie będziecie się nudzić – komentuje ADM.\nGościnnie Solar,\nBiałas, Bałagane, Malik Montana, King Tomb, Leh, Harry , Rose oraz wokalistki\nNatalia Sumpor. \n\nTracklista:\n01. Intro (prod. Got\nBarss)02. Głodny przeżyć\n(prod. Got Barss)03. Cały ja feat. Bałagane, Malik Montana (prod. High\nTower/Olek)04. Anioły i demony\n(prod. Adamo)05. Chcę się zniszczyć\nfeat. King TomB (prod. Fryta Beatz06. Zostawiłem (prod. Got Barss)07. Hellboy (prod. Lanek)08. Moja dupa (prod.\nFryta Beatz)09. Witaj u mnie\n(prod. Johnny Beats)10. Młodość (prod.\nDeemz)11. Wszystko w mojej\ngłowie ft. Harry (prod. Cubson Beatz)12. Serce feat. Leh (prod. Got Barss)13. Każdy (prod. PiNe)14. Podpalam lont\n(prod. Lanek)15. Hold Me ft. Natalia Sumpor (prod. Risk Zero)16. Modlitwa ft. Rose\n(prod. Fryta Beatz)17. Na fali feat. Solar/Białas (prod. BL Beatz)18. Zaraz freestyle\n(prod. Got Barss)', '', 'adm-hellboy-cd', '', '', '', 'ADM - Hellboy - CD', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(82, 1, 1, 'Bedoes &amp; Kubi Producent - Aby śmierć miała znaczenie (reedycja)\nWersja 1CD\n\"Aby śmierć miała znaczenie\" to długogrający, legalny debiut Bedoesa, który szturmem wdarł się na rodzimą scenę. Za muzykę odpowiada jeden z najlepszych producentów młodego pokolenia - Kubi Producent. Na krążek składa się 14 autorskich tracków. Na płycie gościnnie udzielili się: Solar, Białas, ReTo, Beteo oraz reprezentanci ekipy 2115: White &amp; Kuqe. Płyta ukaże się 17 lutego, nakładem SB Maffija Label. \n- Ta płyta powstała po to \"Aby Śmierć Miała Znaczenie\". Moja, Kubiego, każdego kto brał udział przy tym projekcie. Ta płyta to historia, którą tworzymy. Każdy tworzy swoją własną. Nasza rozpoczęła się osiemnaście, szesnaście, dwadzieścia lat temu - zapamiętajcie te słowa. To dopiero początek tego co zrobimy z tą sceną. 2115, SB Maffija - tak opisuje genezę swojego debiutu Bedoes. \n- Kiedy miałem 13 lat marzeniem było dla mnie skomponować dla kogoś utwór. Dziś mam 16 i produkuję całą płytę jako współtwórca albumu. Moje marzenia z czasem przerodziły się w rzeczywistość. Album \"Aby Śmierć Miała Znaczenie\" LP to dla mnie najlepsza rzecz jaką zrobiłem w swoim życiu pod względem muzycznym. Włożyłem w to całe swoje serce i 100 % możliwości. Nie przespane noce towarzyszące mi podczas tworzenia tej płyty na pewno pozostaną mi w pamięci na dobre - dodaje Kubi Producent. \nSzczegółowa tracklista: \nCD1: Bedoes &amp; Kubi Producent - Aby śmierć miała znaczenie (LP)\n01. Łk 1, 46-5502. NFZ03. Biały i Młody04. Hymn feat. Solar, Białas05. Napad06. Raz ft. Beteo (co-prod. Apriljoke)07. Gang, gang, gang08. Aby Śmierć Miała Znaczenie09. Kolega brata rapera10. Jon Snow ft. White (co-prod. Sapi)11. Papito ft. Kuqe12. Typie ft. ReTo13. C\'est la vie14. Anioły', '', 'bedoes-kubi-producent-aby-smierc-miala-znaczenie-reedycja', '', '', '', 'Bedoes & Kubi Producent - Aby śmierć miała znaczenie (Reedycja)', '', '', '', ''),
(83, 1, 1, 'Bedoes &amp; Kubi Producent - Kwiat Polskiej MłodzieżyPremiera: 30.11.2018\nBedoes i Kubi Producent wracają z drugim albumem i zostawiają za sobą przepaść. Album \"Kwiat Polskiej Młodzieży\" różni się od debiutu tak bardzo, że ciężko uwierzyć, że minęło zaledwie 1,5 roku. \nZarówno Borys jak i Kubi w bardzo młodym wieku musieli zmierzyć się z gigantyczną lawiną zainteresowania, która niosła zarówno oznaki bezgranicznego oddania fanów jak i hejtu na skalę jakiej polski hip-hop jeszcze nie widział. Emocjonalny koktajl, który buzował w kotle z nowymi inspiracjami znalazł swoje ujście w nowych nagraniach. Bedoes i Kubi dorośli do roli artystów, którzy nie mają żadnych kompleksów względem sceny europejskiej czy amerykańskiej, a uznawaną dotąd za objaw prowincjonalności polskość przekuli w swój atut. Dzięki niemu \"KPM\" to krążek, który ma szansę stać się głosem pokolenia Polaków urodzonych na przełomie wieków.\nChoć na płycie nie brakuje nowych bangerów i materiału na hity, to \"Kwiat Polskiej Młodzieży\" jest przede wszystkim dowodem rozwoju - zarówno muzycznego jak i emocjonalnego. To osobisty materiał pełen bardzo odważnych i szczerych wersów, ale nie brakuje mu również typowej dla Borysa brawury i kontrowersji. Nie dając się zastraszyć postanowił pokazać, że dalej chce przesuwać granicę, choć tym razem w nieco inną stronę. Jako tekściarz jest bardzo daleki od autocenzury, ale zarazem stanowi rzadki przykład rapera, który czuje odpowiedzialność za swoich fanów. Nie chce być tylko rozrywką, ale również inspiracją. Nadal sprawia wrażenie głodnego i słychać, że potraktował \"wyzwanie drugiego albumu\" bardzo poważnie. \nBedoes: Dla mnie ta płyta to \'wszystko albo nic\'. Stawiam czoła demonom przeszłości i jest to dla mnie osobisty przełom. Niczego lepszego w życiu nie zrobiłem.\nZmieniła się nie tylko treść, ale także forma. Bedoes i Kubi Producent nie boją się roli pionierów. W kwestii rozwiązań muzycznych, produkcji wykonawczej, zaskakującego doboru gości, ale nawet w kwestii emisji głosu i produkcji wokali \"KPM\" jest albumem nowatorskim. Muzyczna świeżość, element zaskoczenia oraz teksty z którymi utożsamić się mogą rzesze fanów. \"Kwiat Polskiej Młodzieży\" rozkwita na naszych oczach.\nTracklista: \n01. Introdukcja02. Kwiat Polskiej Młodzieży03. Janosik (feat. Golec uOrkiestra) 04. Chłopaki nie płaczą (feat. Taco Hemingway)05. 05:0506. Gady (feat. Białas, Eldo)07. Rivendell08. Givenchy (feat. Solar)09. 1000 koni10. Mercedes GLE Coupé (feat. Blacha 2115, Kuqe 2115, Flexxy 2115)11. Toy Story (feat. Rafonix)12. Bardzo przepraszam 13. Delfin (feat. Koldi, Young Multi, Beteo)14. Śnieg15. Wow16. Tarzan', '', 'bedoes-kubi-producent-kwiat-polskiej-mlodziezy', '', '', '', 'Bedoes & Kubi Producent - Kwiat polskiej młodzieży', '', '', '', ''),
(84, 1, 1, ' \nBedoes x Lanek – Opowieści z Doliny Smoków\nNadszedł moment premiery najdojrzalszej płyty Bedoesa w jego dotychczasowej karierze. Trzecia legalna płyta jednego z największych objawień muzycznych ostatnich lat już 29 listopada.\n„Opowieści z Doliny Smoków” to bezkompromisowa wycieczka po uczuciach człowieka doświadczonego przez zepsuty świat. Na płycie kipi od kontrastów. Miłość i poszukiwanie szczęścia staje naprzeciw złym ludziom, dużym pieniądzom i dziewczynom bez zahamowań.\nBedoes startuje z bardzo wysokiego poziomu muzycznego mając za sobą współpracę z największymi ksywami rapowego świata. Młody, ale doświadczony przez branżę, zaczyna eksperymentować z muzyką szukając nowych ścieżek rozwoju, szlifując zarazem styl znany z poprzednich krążków.\nNowa płyta to polemika z otaczającą rzeczywistością i próba odnalezienia wartości cennych dla samego artysty i odrzucenia tych, które sprowadzają na sam dół. Bedoes zaprasza nas do świata pełnego pokus i stara sobie z nimi radzić układając życie tak by czerpać z niego jak najwięcej, bardziej zwracając uwagę na uczucia niż dobra materialne.\nTytuł krążka to alegoria do złego świata przepełnionego złymi ludźmi. Reprezentant SBM Label ukazuje rzeczywistość w ciemnych barwach, starając się być rycerzem dla siebie i swoich bliskich.\nTo pierwszy raz gdy Bedoes pracuje nad legalną płytą bez Kubiego Producenta. Muzyką przy projekcie zajął się legendarny w środowisku Lanek. Współpraca z nowym producentem otwiera Bydgoszczaninowi nowe drogi w muzycznym rozwoju.\nAutorem logo jest Aleks Domański, a poligrafii Rybskie, który w wydaniu wykorzystał zdjęcie Magdaleny Wdziękowskiej.\n\nSklepowa premiera 29 listopada\n1. 1998 (mam to we krwi)2. SAUVAGE ft. Białas, Taco Hemingway3. Opowieści z Doliny Smoków4. Brzydkie Rzeczy ft. DJ Johny5. Wschód (lubię zapierdalać) ft. Kosa, White 21156. Anarchia 2019 (zawsze chciałem to zrobić) 7. Polaco (to też) ft. Mr. Polska 8. Smoki 9. VOGUE 10. Lesbijki 11. Fresh Prince (trill 4ever) ft. Malik Montana 12. Łzy (pierwszy kawałek na tej płycie) ft. Kuqe 2115 13. Jesteś ładniejsza niż na zdjęciach (na zawsze) 14. Fendi (poznaliśmy się w studio) ft. Smxkey Nunno15. Playboy (dla Lanka) ft. Blacha 211516. Gdzie jest Eis? (to dla Was)BONUS TRACKS:17. FPS 18. Hardcore Pleasure ft. Flexxy 2115, Kuqe 211519. Michelangelo ft. Pressa20. Nadchodzi lato', '', 'bedoes-lanek-opowiesci-z-doliny-smokow-standard', '', '', '', 'Bedoes & Lanek - Opowieści z doliny smoków (Standard)', '', '', '', ''),
(85, 1, 1, 'Po dwóch latach od premiery ostatniego solowego wydawnictwa, Beteo powraca z nowym albumem. “HOODIE” to post-osiedlowa historia o życiu w rozdarciu pomiędzy środowiskiem małomiasteczkowego podwórka, z którego wywodzi się artysta, a wielkomiejskim światem, w którym chcąc nie chcąc musiał się odnaleźć. Choć jego otoczenie ulega ciągłym zmianom, Beteo pozostaje wierny ludziom oraz wartościom, które go ukształtowały, mając jednak świadomość, że osiedlowa przeszłość zostanie z nim na zawsze jak blizna.\nDwanaście utworów pełnych bezkompromisowych, celnych linijek i melodyjnych refrenów tworzy spójną całość, a o brzmienie płyty zadbali producenci doskonale znani ze współpracy z artystami SBM Label. Na trackliście znajdziemy takie ksywki jak Deemz, SHDOW, Got Barss czy Oil Beatz. Stworzona przez nich oprawa muzyczna nadaje płycie klimat współczesnego osiedla, którego nie sposób podrobić.\nAutorem zdjęcia okładkowego jest Piotr Pytel (@osiemdziewiec).\nTracklista:01. JEGOMOŚĆ (prod. Got Barss) 02. LAY LOW (prod. Deemz) 03. WIDOK BLOCK (prod. SHDOW) 04. MONEY TALK ft. ?ØØ? (prod. Deemz)05. CO ROZK*RWIA GŁOWĘ (prod. Oil Beatz) 06. GŁUPIO WYSZŁO ft. Białas (prod. SHDOW)07. POR FAVOR (prod. Hubi, Bvrt) 08. JUICE (prod. Deemz) 09. BENZO (prod. Swizzy, SHDOW)10. PIĘĆ KOŁA (prod. Deemz, Miroff)11. NOWE AUTA ft. ?ØØ? (prod. Deemz) 12. HOODIE (prod. Raff J.R.)', '', 'beteo-hoodie', '', '', '', 'Beteo - Hoodie', '', '', '', ''),
(86, 1, 1, 'Beteo\nprzeszedł długą drogę do legalnego debiutu. \"Nowy Pop\"\nto efekt wielu miesięcy  pracy i wyzwanie nie tylko dla artysty, ale\n\nrównież\n\ndla słuchacza.\nLegalny\ndebiut Beteo to próba\nłamania granic, które\npolski hip-hop przez lata narzucał sobie sam. Od początku swojej\ndrogi Beteo robił rzeczy, których\n\"nie wolno\", a które\nw biegu wydarzeń powoli stawały się standardem. Hip-hop stał się\npopem nowych czasów,\na Beteo postanowił podsumować te przemiany, przygotowując album\nnowoczesny, przebojowy i pozbawiony ograniczeń.\nMylą\nsię Ci, którzy\nuważają, że tytuł to deklaracja odejścia od rapowych korzeni.\nOkładkowa sceneria brudnego osiedla nie jest przypadkiem, a\nbezkompromisowe podejście i cięty język jak zawsze są cechami\nwyróżniającymi\nBeteo na tle raperów\njego pokolenia. \"Nowy Pop\" to odwaga sięgania po\nrozwiązania rodem z mainstreamowych płyt, brak obaw przed melodią\ni posądzeniem o \"sprzedanie się\", ale zarazem dowód\nna to, że zamykanie się mediów\nna nową muzykę pokolenia wyhodowało prawdziwego potwora rodem z\nbrudnej klatki. \n\n\"Nowy\nPop\" to dwanaście kawałków,\nz których\nkażdy mógłby\nstać się potencjalnym singlem. Gościnnie na krążku pojawili się:\nReTo, White 2115, Merghani oraz Żabson. \n\nMimo\ninspirowanego popem i nowoczesnym mainstreamowym rapem brzmienia o\nktóre\nzadbali m.in. Got Barss, Kub Producent, Deemz czy Loren płyta nie\ntraci osobistego charakteru, a jej treść to dokument z\nniespokojnego życia artysty na przestrzeni ostatnich kilkunastu\nmiesięcy. To podnoszenie sobie poprzeczki i kolejny krok naprzód\nw artystycznym rozwoju, ale zarazem kolejne przesunięcie granicy.\nMuzyka z podwórka,\nktóra\nprzestała być amatorska, a zaczęła z podniesioną przyłbicą\nwchodzić na salony. To Nowy Pop!\n\nNOWY\nPOP (tracklista):\n\n01.\nJa (prod. Got Barss)02.\nPopstar/Rockstar ft. White 2115 (prod. Kubi Producent)03.\nDomki na drzewach ft. Merghani (prod. Babinci)\n04.\nZnasz mnie? (prod. Got Barss)05.\nAquapark ft. Żabson\n(prod. Oil Beatz)\n06. Kocha, nie kocham (prod.\nLoren)\n07. Paradise (prod. Got Barss)\n08. Wszystkie nasze byłe (prod.\nBabinci)\n09. Meow ft. ReTo (prod. Loren)\n10. Nowy Pop (prod. Deemz)\n11. Rollercoaster (prod. Loren)\n12. Ty (prod. Babinci)', '', 'beteo-nowy-pop', '', '', '', 'Beteo - Nowy Pop', '', '', '', ''),
(87, 1, 1, '\"H8M4” to\nkontynuacja serii dobrze znanej najwierniejszym fanom artysty. Białas na trzech\npierwszych mixtape\'ach szlifował umiejętności, które prezentuje w pełni na\nnajnowszej płycie, powracając do agresywnego stylu, będącego jego\nwizytówką. \nAlbum składa się z 12\npremierowych nagrań.\nNa płycie gościnnie\npojawią się Solar, Bonson, Beteo, Bedoes, Zelo PTP oraz\nwokalistka ZUI.\nZa muzykę odpowiadają\nw głównej mierze Lanek oraz Got Barss. Jeden utwór został wyprodukowany przez\nBob Air\'a.  \nAlbum wydany został w\nformie audiobooka (twarda oprawa, książeczka z tekstami + płyta). \n \nTracklista: \n01. Witam Cię 2k16 ft.\nZelo PTP (prod. Got Barss)02. Patrzcie idzie\nfrajer ft. Bedoes (prod. Got Barss)03. Mamo, siegam\ngwiazd (prod. Bob Air)04. Jedna wiara jeden\nskład (prod. Got Barss)05. Mali ludzie,\nwielkie nieba ft. Zui (prod. Got Barss)06. Jeden żyć (prod.\nLanek)07. Chamer (prod.\nLanek)08. Mam dość (Love\nyourz - remix) ft. Bonson (prod. Lanek)09. Blakablakablaka\n(prod. Lanek)10. Nie śpię bo\ntrzymam garde (prod. Got Barss)11. I poszedł (prod.\nGot Barss)12. Tracimy kontrolę\nft. Solar, Beteo (prod. Got Barss)', '', 'bialas-h8m4', '', '', '', 'Białas - H8M4', '', '', '', ''),
(88, 1, 1, 'H8M5 \nOkładka: Piotr Pytel aka @osiemdzięwiećRzeźba: Tomasz Górnicki1CD\n1. Inwazja ft. Grzegorz Ciechowski2. Sępy ft. Szpaku3. Nowa legenda4. Pod nadzorem5. Moja wina6. Morfina ft. Bedoes7. Potępiony ft. Kara8. Na ulicy9. W imię ojca trapu10. Swoosh gang ft. Pezet11. Toniemy ft. Smolasty12. Prawdziwy król\n2CD1. Drift ft. Mata2. Skit 13. Ból dupy ft. ADM4. Zło jest wszędzie ft. Bedoes5. Skit 26. Pasy ft. Beteo7. Skit 38. Smutne miasteczko ft. Szpaku9. Sweet home ft. White 211510. Skit 411. PDW ft. Mata12. Shuriken13. Skit 514. Piękna15. Skit 616. Trapsos17. Skit 718. Łzy feniksa', '', 'bialas-h8m5-standard', '', '', '', 'Białas - H8M5 (standard)', '', '', '', ''),
(89, 1, 1, 'REHAB to Białas,\njakiego jeszcze nie było. Warszawski raper, znany głównie z mocnej braggi i\nczęstych personalnych zaczepek w stronę kolegów z branży, debiutuje materiałem\ndojrzałym rozliczając się ze sobą i swoim dotychczasowym lekkomyślnym i\nmelanżowym trybem życia\nSolowy debiut Białasa,\nto przede wszystkim dużo gorzkich przemyśleń dorosłego człowieka, który jest\nzawieszony między dwoma światami – brutalną rzeczywistością i światem muzyki. W\nrezultacie powstał materiał pełen emocji i świetnie poprowadzonych życiowych\nhistorii. Mimo tego raper nie stracił charyzmy, z której był do tej pory\nrozpoznawany. Dalej obecna jest specyficzna stylowa SB Mafii, a chamskie i\njednocześnie błyskotliwe wersy, których pełno, nie pozwalają nam zapomnieć, że\nmamy do czynienia z byłym freestyle’owcem.\nBrzmieniem zajął się\njeden producent – Deemz. Przełożyło się to na spójną i bardzo nowoczesną\nwarstwę dźwiękową, która świetnie współgra z tym, co do przekazania ma sam\nraper.\nGoście, którzy\npojawiają się na płycie, wspomagają Białasa głównie w refrenach. Na „Rehab”\nusłyszymy m.in. Palucha, Quebonafide, Dannye’go, Solara i Gedza. Autorem\nokładki jest Tomasz Bojar.\nTracklista:\n             1. Intro-detoks-ja + DJ\nTaek              2. Złamane skrzydło\n             3. Rehab\n             4. Życie ćpuna\n             5. Aaliyah\n             6. 6am in wwa + Olka\n             7. Do grobu + Solar, Gedz\n             8. Kroki + Danny\n             9. Że cham\n           10. Czy\n           11. To jest hiphop + Paluch\n           12. Złote serca + Quebonafide\n           13. Lepszego życia bilet', '', 'bialas-rehab', '', '', '', 'Białas – REHAB', '', '', '', ''),
(90, 1, 1, 'Białas\n&amp; Lanek - HYPER2000\nTwórczość\nBiałasa &amp; Lanka to ciągły wyścig z samymi sobą. W nieco\nponad rok od premiery \"POLONu\" na rynek trafia kontynuacja\n- drugi album duetu pod tytułem \"HYPER2000\" ukazał się 5\npaździernika 2018.\n\"HYPER2000\nto suma emocji i przeżyć\nnaszej ery, ery roku 2000. Nasz ślad w czasoprzestrzeni\" -\nmówi autor całości muzyki i producent wykonawczy - Lanek. Na\nnajbardziej dopracowanych podkładach w dorobku krakowskiego\nproducenta, Białas postanowił w swoim stylu skomentować\nwspółczesność,\nktórą\nw coraz większym stopniu kreują \"millenialsi\". W dosadny,\nchwilami bardzo gorzki sposób,\nale zarazem tak by nie utracić nic z przebojowości definiującej\n\"HYPER2000\". Z tarcia pomiędzy płytami tektonicznymi\ndwóch\nmłodszych pokoleń Polaków\npowstało brzmienie, które\nwykreowała charakter nowej płyty Białasa i Lanka podkreślony\noprawą wizualną stanowiącą integralną część projektu. \n\nZłożony\nz 12 kawałków\nalbum to wynik bardzo\nrygorystycznej selekcji, po której\nna albumie zostały jedynie najważniejsze numery z wszystkich sesji.\nDbałość o detal, ciągłe podnoszenie sobie poprzeczki i niemal\nchorobliwa ambicja zaowocowały dojrzałym materiałem, który\nnie stracił zarazem szczeniackiej zajawki i energii. Celem było\nwysokie repeat value i wrażenie, że na płycie wszystko znajduje\nsię na swoim miejscu.\n\"HYPER2000\"\nto spójna\ncałość łącząca w sobie skrajności. Znajdziemy tutaj zarówno\npełne punchline\'ów\nbangery z ulicznym sznytem jak i poruszające kawałki z refrenami od\nktórych\nciężko się uwolnić. Białas wrócił\ndo bardzo osobistych tekstów,\nktóre\nzawstydzają swoją szczerością i pozwalają łatwo utożsamić się\nnie tylko ludziom o podobnych doświadczeniach. Niejedną linijkę\nmożna boleśnie poczuć na własnej skórze.\n\n\n\nTRACKLISTA:\n\n01. Cyka Blyat02. Przestań się bać03. Polack04. Milion długu05. Prawdziwy Trap\n06. Blizny na rękach 07. Unplugged 08. Karmamachanam 09. Kochaj nas i żegnaj 10. Lustra 11. Tlen 12. Upadły demon', '', 'bialas-lanek-hyper2000-standard', '', '', '', 'Białas & Lanek - HYPER2000 (standard)', '', '', '', ''),
(91, 1, 1, 'BIAŁAS &amp; LANEK - POLON (WERSJA STANDARD)GOŚCINNIE: QUEBONAFIDE, PALUCH, BEDOES, SITEK oraz ZUIPREMIERA SKLEPOWA: 15.09.2017 ILOŚĆ CD: 1Ostrzeżenia przed napromieniowaniem radioaktywnym na terenie całego kraju i zapowiedzi najgorętszego dnia tegorocznego września to nie przypadek. Przyczyną tych zjawisk jest POLON - pierwiastek chemii  twórczej BIAŁASA i LANKA i kontynuacja wieloletniej współpracy w zupełnie nowym wydaniu. Sukces platynowego \"H8M4\" na którym Lanek odpowiadał za cztery podkłady okazał się jedynie preludium do wspólnego lotu, którego pełnym wyrazem jest album duetu w systemie raper/producent.\nBIAŁASA i LANKA łączą niespożyte pokłady kreatywności, którą czasem jest w stanie wyzwolić prosty impuls, a jej owocem w przeciągu kilkudziesięciu minut może stać się przyszły hit. Kilka miesięcy spędzonych wspólnie w studio przyniosło taki ogrom materiału, że problemem w finalizacji tracklisty stała się... klęska urodzaju. Obydwaj spotkali się w najwyższej dyspozycji i tak też brzmi efekt. Jest to niewątpliwy atak na klasyk.\nPOLON to próba wprowadzenia polskiego akcentu do brzmienia europejskiej hip-hopu i okiełznania niemal nieograniczonych możliwości dla dobra materiału - tak aby różnorodność pogodzić ze spójnością, brawurę ze real talkiem, a osiedlówę z wrażliwością. O sile oddziaływania najbardziej polskiego z pierwiastków przekonacie się odpalając jeden z najmocniejszych albumów ostatnich lat w polskim rapie. Nadchodzi POLON!Gościnnie na krążku pojawili się: Quebonafide, Paluch, Sitek, Bedoes oraz wokalistka ZUI. \nTracklista:\nCD 1: 01. KOŁO02. POLON03. SIMIA04. OSIEDLE BOTOX05. JAK SKEPTA06 .NA SERIO + Bedoes07. ITS MY LIVE08. NOAH + Zui09. WEED CARRIER10. FRAKTALE11. GANGES + Quebonafide12. HOW13. BIDA + Sitek14. XORCYZMY15. FAKE POLO16. ALE JA NIE + Paluch17. PUK PUK', '', 'bialas-lanek-polon-standard', '', '', '', 'BIAŁAS & LANEK - POLON (standard)', '', '', '', ''),
(92, 1, 1, 'Płyta BONSON/MATEK - O nas się nie martwTrack lista:1. Jeszcze później2. Szedłem po nieśmiertelność3. Brudna krew gośc. Pih, Enoiks, Troom4. Trudne sprawy5. Piotruś Pan gośc. Wini6. Nie zapamiętasz7. Gasną lampy w moim pokoju gośc. Planet ANM, TMK aka Piekelny8. Umiem robić sobie wrogów9. Nie wiem czy jestem gośc. Mam na imię Aleksander10. Nad ranem11. Haj$, flota (cuty Dj Noriz)12. Wiem co stracę (gitara Jacek Osieczko)13. Goście, goście14. Kochają mnie, gdy upadam gośc. Sobota15. Pisz, pisz16. Jesteśmy gdzieś17. Outro', '', 'bonson-matek-o-nas-sie-nie-martw', '', '', '', 'Bonson/Matek – O nas się nie martw', '', '', '', ''),
(93, 1, 1, '27 to czwarty album solowy polskiego rapera Eldo. Wydawnictwo ukazało się 26 marca 2007 roku nakładem wytwórni muzycznej My Music. Produkcji nagrań podjęli się Flamaster, Kixnare, Daniel Drumz, Dena, Webber, Czarny oraz DJ Gris.1. Co słychać?2. 273. Szyk (gościnnie Pjus)4. Noc, rap, samochód (gościnnie Diox)5. Noc (skit)6. Zamieć prawdę pod dywan7. Krew, pot, sperma i łzy8. Dzieciństwo9. I\'m in love10. Styl, flow, orginalność11. Dany Drumz gra funk12. Ferajny13. Spacer14. Są rzeczy, których chciałbym nie pamiętać15. Więcej16. Koniec', '', 'eldo-27-reedycja', '', '', '', 'Eldo - 27 (reedycja)', '', '', '', ''),
(94, 1, 1, 'Po 13 latach doczekaliśmy się reedycji płyty \"Fach\" formacji Flexxip.Kto nie ma, a powinien, wie co robić.Track lista:\n01. Intro02. Własny wstyd (DJ Panda Remix)03. Oszuści\" feat. Ciech04. List\"05. Sztukam tego $06. Teksty do bitów07. 8-808. (Y)09. Powiedz, gdzie jest f. (1) feat. Lerek10. Nie jestem feat. Fu11. Uwierz we mnie12. Milion razy feat. 2cztery713. Mam wiadomość14. Acha15. Dzień w dzień (zrzuty) feat. 2cztery7 + bonus: 5-10-20 (oldskul mes)', '', 'flexxip-fach', '', '', '', 'Flexxip - Fach', '', '', '', ''),
(95, 1, 1, 'To już trzecia część “Heartbreaks and Promises\", kompilacji, która promuje najświeższe nurty w muzyce miejskiej. Tym razem do projektu obok czołówki polskich producentów sceny elektronicznej, zostali zaproszeni także uznani rodzimi wokaliści. W efekcie otrzymujemy złożony z 16 utworów album, nad którym przez rok pracowało 40 artystów. Ciężko uniknąć stwierdzenia “tego jeszcze nie było\".\nTrack lista:\n01. Klaudia Szafrańska / ENZU “Ulotne\"02. Michał Sobierajski / Suwal “Szukam\"03. SONAR / Buslav “Dzisiaj\"04. Natalia Nykiel / Flirtini “Mapy\"05. Justyna Święs / Klaves “Gabriel\"05. Ras / Homex / Globalny Odlot “Szanse\"06. Julia Wieniawa / Zeppy Zep “Na zawsze\"07. SoDrumatic / Sarcast “Muszę wyjść\"08. Iza Lach / Pepe. “Sukienka\"09. Gedz / Otsochodzi / Pham “uberPOP\"10. Piotr Zioła / Flirtini “Bilet\"11. Małe Miasta / Rosalie. “Blisko\"12. KaCeZet / Err Bits “Cień\"13 WÜ / Reni Jusis / BARANOVSKI “Donikąd\"14. VNM / Spisek Jednego “Książki\"15. Paulina Przybysz / Kroki “Moves\"', '', 'flirtini-heartbreaks-promises-vol-3', '', '', '', 'Flirtini - Heartbreaks & Promises Vol. 3', '', '', '', ''),
(96, 1, 1, '\"Evil Twin\" to długo wyczekiwany, debiutancki album Guziora, młodego rapera reprezentującego wrocławską scenę.\nTracklista:01. Gambino (prod. Skrywa, skrecze DJ Flip) 02. Omori Omori (prod. SecretRank) 03. Eehe (prod. SecretRank) 04. Karnawał (prod. Skrywa) 05. SSJ2 (Same Kłopoty) (prod. EksoticBeats) 06. Tajfun92 (prod. Skrywa) 07. Normalnie Żyjąc (prod. Adamo) 08. Po staremu ft. Deys (prod. Wezyr) 09. YuGiOh (prod. Adamo) 10. Jerry Springer (prod. Walchuck) 11. Piniata (prod. SecretRank, skrecze DJ Flip) 12. Piniata remix (prod. Wezyr, skrecze DJ Flip)13. Stranger Things (prod. Adamo) (Bonus Track)', '', 'guzior-evil-twin', '', '', '', 'Guzior - Evil Twin', '', '', '', ''),
(97, 1, 1, ',,Dożyłem 25 lat i nie będę nic zmieniał\" to trzeci drugi album Holaka, który ukaże się 10 sierpnia 2018 r. Mateusz zaprosił fanów do wglądu w proces kończenia płyty, prezentując im kolejne wersje okładki, tracklisty oraz dokument z pracy w studiu, a także zapraszając wybrańców na odsłuch miksów. Całość powstała we współpracy producenckiej z Maxem Psują. Na krążku usłyszymy gościnnie takie nazwiska jak: Włodi, Jan-rapowanie, Ralph Kaminski oraz Frosti Rege.\nTrack lista:\n01. GTA02. Pastelowy Power Ranger03. Do zobaczenia do jutra04. Ćwiczenia z zapominania05. Kuzyn ziomka z podstawówki (feat. Włodi)06. Bluza (feat. Jan-rapowanie)07. Miłość08. Literki (feat. Frosti Rege)09. Najlepsze Najgorsze Wakacje (feat. Ralph Kaminski)10. Smile11. Moje błędy to ziomal12. Stresscredit13. Niedoczekanie14. Wakacje są od tego, by się uczyć', '', 'holak-dozylem-25-lat-i-nie-bede-nic-zmienial', '', '', '', 'HOLAK - Dożyłem 25 lat i nie będę nic zmieniał', '', '', '', ''),
(98, 1, 1, 'Mateusz Holak nie przestaje zaskakiwać. W Walentynki, bez żadnej wcześniejszej zapowiedzi ukazał się jego długo wyczekiwany solowy album. Tytułu ,,The Introvert\" nie znajdziemy jednak na stojakach z płytami, tylko… na półkach z prasą muzyczną. Został on bowiem wydany w formie magazynu z CD, stanowiącymi nierozłączną całość.Krążek zawiera łącznie 18 utworów, nie zabraknie też na nim muzycznych gości. Sam magazyn zawiera natomiast wyjątkowe ilustracje autorstwa Forina, Beaty Śliwińskiej oraz Oskara Podolskiego.Płyta i album Mateusza Holaka. Grafika i muzyka występują tu obok siebie i wzajemnie się uzupełniają tworząc jedno dzieło. Na krażku gościnnie wystąpili bardzo uznani artyści z różnych środowisk, w tym Paulina Przybysz, Ten Typ Mes, Ras Kasia Golomska (Lilly Hates Roses), W.E.N.A. czy Hades.ISBN/EAN: 9788394717612\nTrack lista:\n91. Intro02. Grube zdjęcia03. Znaki04. Wszędzie dobrze05. 199206. Co to to nie07. Bycie introwertykiem to zajebista sprawa08. 50009. Dobra firma10. Sos 1000 wysp11. Odżywiam się zdrowo na smutno12. Skit dłuższy13. Kot14. Otwarte15. Brat16. Analogowe serce17. Jak się pożegnać18. Klucze', '', 'holak-the-introvert', '', '', '', 'Holak - The Introvert', '', '', '', ''),
(99, 1, 1, 'W\nniecały rok od premiery pierwszej  płyty Jan-rapowanie &amp; NOCNY\nwracają z albumem \"Plansze\". Legalny debiut duetu trafił na\npółki\nsklepowe 15 marca 2019.\n\"Plansze\"\nto \"opowieść dwudziestolatka,  który\nwidzi, czuje i stara się\nprzeżyć swoją młodość najbardziej, jak to tylko możliwe\".\nTo spójny,\nale różnorodny\nmateriał, który\nprzeciągnie\nWas po wielkomiejskich klubach, zostawiając po sobie coś więcej\nniż kaca. Nie jest to relacja z imprezy, a raczej wyniesiona z niej\nrefleksja - Kogo można tam spotkać? Czego tam szukamy? Co nie jest\nwidoczne na pierwszy rzut oka, a kryje się głębiej?\n\"Plansze\"\npozwalają nam spojrzeć na świat oczami wychowanków\nwielkich miast, żyjących\nw ich tempie, korzystających z ich możliwości i uroków.\nMuzycznie NOCNY prowadzi nas w rejony dotąd\nnieodkryte dla polskiego rapu, destylując własny styl z muzyki,\nktóra\nukształtowała\njego gust wiele lat temu. Dwa światy obu autorów\nzderzają\nsię tutaj tworząc coś nowego i własnego. \n\nŻycie\nto dla artystów gra, przechodzenie kolejnych etapów, wykonywanie ruchów na\ntytułowych\n\"Planszach\". Niebawem przekonacie się, że te plansze mogą\nwydać się Wam znajome. \nCałą poligrafię i oprawę wizualną\npłyty przygotował laureat Arena Design Awards 2019 - Michał Loba.\nSklepowa premiera krążka odbędzie się 15 marca.\n012 Jutro feat. SolarZaczekaj przed drzwiamiRuchyUkładanka feat. HolakCo Tam feat. OtsochodziPotrzeby feat. KacperczykMillenium SportWszystko OKChemia (skit)Wybory feat. Szpaku, GuziorSłowo na koniec', '', 'jan-rapowanie-nocny-plansze-wersja-standard', '', '', '', 'Jan-rapowanie & Nocny - Plansze (Wersja Standard)', '', '', '', ''),
(100, 1, 1, 'Uśmiech. Dlaczego Jan-rapowanie i NOCNY właśnie tak nazwali swój nowy album? Bo, jak pisał jeden stary Szkot, to w uśmiechu jest klucz do rozszyfrowania człowieka. I dlatego, że Janek trochę dojrzał, co nie znaczy, że przestał się uśmiechać. Czasem śmieje się smutno - po roku w częściach nie wszystko jest łatwo wyprostować. Choć wreszcie kupił sobie żelazko, to wersy nadal ma trochę pogniecione. Lekkie rapowanie o rzeczach ciężkich i świadomość tego, że słabość do tańca nie przeszkadza w tym, by sporo czuć i myśleć, to sedno w wypadku tej postaci. \nJan-Rapowanie myśli również o ludziach. Wystarczająco dużo, by nie udawać starszego, niż jest. Nie ślepnie od świateł Warszawy, jednak mruży od niej oczy, odwracając czasem głowę w stronę Krakowa. Chociaż ma jeden semestr, z sympatią witają go w starej i nowej szkole. Egzaminy z refrenów zdaje śpiewająco. Tworzy całość ze świeżymi, eklektycznymi brzmieniami Nocnego, który znów udowadnia, że jego produkcje w niczym nie ustępują tym autorstwa bardziej popularnych kolegów po fachu.\nMożesz nazwać „Uśmiech” płytą środka, przy czym pamiętaj, że Janek w środku posprzątał i zaprasza cię do swego świata. To do wszystkich graczy, którym nie trzeba tłumaczyć. I do każdej laski, która umie fajnie tańczyć. Stary nowy Jan-Rapowanie. Człowiek, poza tym raper, cześć.\n____\nAutorem zdjęć wykorzystanych w poligrafii albumu, w tym zdjęcia okładkowego, jest Paweł Fabjański, a za oprawę wizualną i projekt wydania odpowiadają Bartek Walczuk i Julia Konopka, Osom Studios.\nTracklista:\nPilotCo ja wiem? (feat. Vito Bambino) ThxmYBąbelekGŁÓWNY (cuty DJ Kebs)CENTRALNYNie pomogęZapałkiDziewczyny z klasyGap yearNikt mi nie kazał', '', 'jan-rapowanie-nocny-usmiech-wersja-standard', '', '', '', 'Jan-rapowanie & Nocny - Uśmiech (wersja Standard)', '', '', '', ''),
(101, 1, 1, 'Trudno znaleźć gościa, który w tak młodym wieku osiągnąłby w muzyce tak wiele nie wydawszy nawet jednego solowego albumu. Z pomocą przychodzi Janusz Walczuk, a jego legalny debiut zatytułowany, a jakże, “Janusz Walczuk” ukaże się już 30 kwietnia.\nInspirująca droga Janusza, której kolejnym etapem jest jego pierwsza pełnoprawna płyta, ma swój początek wśród przywoływanych na niej wielokrotnie żoliborskich bloków. Tam zawiązały się trwające po dziś dzień pierwsze przyjaźnie, a utrzymanie balansu między zwyczajną codziennością i osiedlowymi realiami było prawdziwym wyzwaniem, któremu nie wszystkim udało się sprostać. Janusz wyszedł z tego obronną ręką dzięki realizowaniu wielu pasji, a muzyka była najważniejszą z nich.\nNa swoim debiutanckim krążku Janusz Walczuk zabierze was w podróż po swoim szalonym, wielowymiarowym życiu i głosem doświadczonego motywatora opowie o tym, jak dzięki ciężkiej i systematycznej pracę można osiągać kolejne sukcesy. Zgodnie z dewizą “Wspólną siłą damy radę”, Janusza wsparli goście, wśród których znaleźli się czołowi męscy reprezentanci rapowej sceny - wieloletni znajomi artysty - ale nie zabrakło także kobiecych wokali. Głównym autorem muzyki jest coraz bardziej zyskujący na popularności Pedro, z którym Janusz rozpoczął współpracę bezpośrednio przed przełomowym dla siebie “Hotelem Maffija”.\nJanusz Walczuk nad muzyką pracuje w zasadzie na każdej płaszczyźnie, dlatego w jego debiucie nic nie jest dziełem przypadku. Wieloletnia praca nad brzmieniem, nagrodzona licznymi złotymi i multiplatynowymi wyróżnieniami, znalazła odzwierciedlenie w jego pierwszym legalnym wydawnictwie, dopracowanym w każdym calu i zrealizowanym od podstaw w zachodnim stylu. To płyta dla wszystkich tych, którzy żyją marzeniami i robią wszystko, by wcielić je w życie. Jak mówi jej główny bohater: “Ten album przedstawia mnie takiego, jakim jestem w tym momencie. Traktuję swoje życie jak film, a muzyka, którą tworzę, jest jego soundtrackiem”. Legalny debiut jest kolejnym punktem do odznaczenia na jego liście marzeń, ale na pewno na tym nie poprzestanie. Janusz Walczuk to twój nowy idol.\nTracklista:\nCześć, jestem Jaś (prod. Pedro)Tak mi ucieka czas (prod. SHDOW x Premixm)Janusz Walczuk (prod. Pedro)22 ft. Jan-Rapowanie (prod. Pedro)Łakomy kąsek ft. Smolasty (prod. Premixm)Zobacz (prod. Chino AP)MDK ft. Levvska (prod. Dr Super Smash, Pedro, sem0r)Offside (prod. Lucassi)Muszę o siebie dbać ft. Kacha (prod. Ktotozrobił)Amsterdam ft. Young Igi (prod. Pedro)Nie wiem jak ft. Young Leosia (prod. Pedro)Cały czas coś ft. Garson (prod. Pedro)Adios ft. Białas (prod. Łukasz Pękacki)Wracam na Żoliborz (prod. Pedro)', '', 'janusz-walczuk-janusz-walczuk-standard', '', '', '', 'Janusz Walczuk - Janusz Walczuk (standard)', '', '', '', ''),
(102, 1, 1, 'Kacperczyk - Sztuki Piękne\nKACPERCZYK “Sztuki Piękne” to debiutancki album dwóch braci - Maćka i Pawła Kacperczyka. Jest to pierwszy krążek w katalogu SBM Label, który można - choć nie trzeba - umieścić w przegródce ‘alternatywny’. Ścieżka do debiutu pod szyldem KACPERCZYK prowadziła przez lata podziemnej działalności w ramach lokalnych, lubelskich zespołów, która zawiodła chłopaków na sceny największych polskich festiwali muzycznych, takich jak Open’er, Spring Break czy Orange Warsaw Festival.  Dwa single wydane w 2019 roku pod szyldem SBM Label wystarczyły, by drzwi do największych scen otworzyły się po raz kolejny. KACPERCZYK wystąpili na Kraków Live Festival oraz ponownie na Open’erze, gdzie zaprezentowali przedpremierowo materiał ze “Sztuk Pięknych”. \nKACPERCZYK na albumie “Sztuki Piękne” są autorami zarówno muzyki jak i tekstów, wyjątek stanowią gościnne zwrotki czołowych przedstawicieli polskiego rapu i alternatywy. Ich pierwszy w całości wspólny projekt to zapis przeżyć i obserwacji młodych ludzi po zderzeniu się z nową rzeczywistością, która zastała ich po przenosinach z rodzinnego Lublina do Warszawy. Siłą materiału jest braterska chemia. Ironiczne, przepełnione historiami i obserwacjami teksty Maćka zabierającego słuchacza na spacer po nowo zastanej rzeczywistości naturalnie współgrają z warstwą muzyczną autorstwa Pawła, w której elektronika miesza się z popem, elementami punk rocka i brzmieniami charakterystycznymi dla zachodniego wybrzeża USA. Album promują single: “Iggy”, dostrzeżony i doceniony przez samego Iggiego Popa; “Nie wyjadę” z gościnnym udziałem Jana-rapowanie, do którego teledysk otrzymał nagrodę w kategorii muzyka alternatywna na festiwalu PL Music Video Awards; H4R1BO oraz “Blask”, w którym udzielił się Ralph Kaminski. \nTracklista:\nSZTUKI PIĘKNEIGGYCHWILE14.02 FEAT. TENTYPMESJUMBO JETKALEJDOSKOP FEAT. GVERILLAH4R1B0NIE WYJADE FEAT. JAN RAPOWANIEBLASK FEAT. RALPH KAMINSKIBETONZOMBIE FEAT. BIAŁASZDJĘCIA', '', 'kacperczyk-sztuki-piekne-standard', '', '', '', 'Kacperczyk - Sztuki Piękne (standard)', '', '', '', ''),
(103, 1, 1, 'Trzecie wydanie, dwa poprzednie wyprzedały się w łącznej liczbie 1060 sztuk.\nRymy: Kamil PivotBity: UrbOkładka: Tadzio Sosnowski X Jacek Walesiak (UVMW)Koncepcja graficzna + kolorowanki: Jacek Walesiak (UVMW)\nPłyta wydana jest w formie trzyskrzydełkowego digipacka z kieszonką, w której znajdują się kolorowanki do każdego z utworów. Kolorujcie je i wrzucajcie na Instagrama z hashtagiem #tatohemingway (nie, nie będzie żadnego konkursu, po prostu będzie mi wtedy miło).\nTracklista:\n1. Mandarynki2. Siódmy sezon3. Mapa Chile4. Tylko po chleb5. Niezgon6. Sny o Intertoto7. Pogoda na bluzę8. Który rocznik?', '', 'kamil-pivot-tato-hemingway', '', '', '', 'Kamil Pivot - Tato Hemingway', '', '', '', ''),
(104, 1, 1, '\"Nowe Rzeczy\" to drugi solowy album radomskiego rapera KęKę. Po sukcesie debiutanciego krążka \"Takie Rzeczy\" (status złotej płyty) i ponad dwunastu miesiącach w trasie, KęKę wraca, aby mówić o tym, co na sercu leży.Na \"Nowych Rzeczach\" przekazuje swą opowieść o wychodzeniu z nałogu i uczeniu się na nowo, jak ogarnąć codzienność. KęKę nie poucza, choć mówi o sprawach ważnych swoim niezmiennie szorstkim, dosadnym i nieubarwionym frazesami językiem. Na płycie nie zabraknie też jednak lżejszych tematów, \"żeby nie było za smutaśnie\" - jak podsumowuje sam raper.Za muzykę odpowiedzialni są: Uraz, Lanek, Sherlock, Donde, Matheo, MilionBeats, Pawbeats, Johnny Beats.Pierwszym singlem promującym album \"Nowe Rzeczy\" jest klip \"Wyjebane (Tak Mocno)\"\n\nTrack lista:\n01. Zmysły02. Nie Bądź Zły03. Wyjebane (Tak Mocno)04. W Dół Kieliszki (WuDeKa)05. Młody Polak06. Niezrzeszony07. Pamięć Zostaje08. Sprawy Ważne09. Fajnie10. Świadomość11. Czasem Muszę12. ...13. To Co Mam (Bonus Track) re-master.', '', 'keke-nowe-rzeczy', '', '', '', 'Kękę - Nowe Rzeczy', '', '', '', ''),
(105, 1, 1, '„Takie Rzeczy” to debiutancki album radomskiego rapera KęKę.\nLista utworów:\n„Nigdy dość” (produkcja: Zioło) – 3:43„Zostaję” (produkcja: Czarny) – 4:07„Ja się pytam” (produkcja: Lucricausa) – 3:23„Nie wiedziałaś” (produkcja: 2sty) – 3:11„Iskra” (produkcja: Tytuz) – 3:14„Z Boku” (produkcja: MilionBeats) – 3:17„Sama powiedz” (produkcja: Czarny) – 4:11„Jeden kraj” (produkcja: Zioło) – 3:46„Dużo nie trzeba” (produkcja: Tytuz, scratche: DJ VaZee) – 2:45„Trasa (BraKaKa)” (produkcja: Pawbeats) – 2:59„Wszystko pięknie” (produkcja: Zioło, scratche: DJ VaZee) – 3:05„Chwila” (produkcja: 2sty, scratche: VaZee) – 3:12„Znakomicie” (produkcja: Lanek) – 3:24„Krucjata” (produkcja: UrbanBeats) – 3:58„Dziękuję” (produkcja: LuckyLoop) – 3:38', '', 'keke-takie-rzeczy', '', '', '', 'Kękę - Takie Rzeczy', '', '', '', ''),
(106, 1, 1, 'Po ogromnym sukcesie „To Tu” (podwójna platyna, przeszło 120 koncertów w kraju i na świecie, ponad 130 milionów odtworzeń w serwisie YT), KęKę powraca, by po raz kolejny Was zaskoczyć. „Mr KęKę” to najbardziej zróżnicowany z dotychczasowych albumów rapera. Lekkie, czasem prześmiewcze numery przeplatają się z poważnymi, refleksyjnymi i nierzadko gorzkimi utworami. \nZa warstwę muzyczną odpowiada czołówka polskich producentów: PLN Beatz, Sergiusz, 2K, Deemz, Moody Scrag, Worek, SoDrumatic, Young Veteran$, Dj Frodo i @PSR. Jest nowocześnie, ale też melodyjnie, czyli sprawdzona mieszanka do jakiej przyzwyczaił nas KęKę. Całości dopełniają starannie dobrani goście: Paweł Domagała, Kasia Grzesiek, Paluch, Sebastian Riedel, Grizzlee. Zapraszamy Was w muzyczną podróż, przez śmiech, gniew, beztroskę i łzy.01. Powiedz Mi Czemu (gość Paweł Domagała; prod. PLN Beatz)\n02. Na Blok (gość Grizzlee; prod. Sergiusz)\n03. Myślę O Tym (prod. Sergiusz)\n04. Czarna Chmura (prod. Sergiusz &amp; 2K)\n05. Na Pewno (gość Kasia Grzesiek; prod. 2K)\n06. Dokąd Iść (prod. Deemz)\n07. Moje Sny (gość Paluch; prod. Worek &amp; Moody Scrag)\n08. Drogi Tato (gość Sebastian Riedel, prod. SoDrumatic, gitara Sebastian Riedel)\n09. Ty Do Mnie Przyszłaś (gość Grizzlee; prod. Deemz &amp; Young Veteran$)\n10. To Tylko Rap (prod. Deemz &amp; Young Veteran$)\n11. Safari (prod. Dj. Frodo)\n12. Nie To Nie (prod. @PSR)\n13. Pora Mówić Nara (prod. @PSR)', '', 'keke-mr-keke', '', '', '', 'Kękę – Mr. Kękę', '', '', '', ''),
(107, 1, 1, 'Po komercyjnym i artystycznym sukcesie \"Trzecich Rzeczy\" (podwójna platyna, ponad 130 koncertów w kraju i Europie), KęKę wraca by otworzyć nowy rozdział.\n\"To tu\", to dojrzały i życiowy materiał, okraszony dawką humoru i sporą dozą autorefleksji.\nTym razem KęKę postanowił zaprosić gości, którzy swoją obecnością stworzyli nową jakość i doskonale wkomponowali się w osobiste utwory radomianina. Warstwa muzyczna utrzymana jest w nowoczesnym klimacie, chociaż nie zabraknie też klasycznego brzmienia.\nTytuł oraz oprawa graficzna, za którą odpowiada Marta Smerecka, w dosadny sposób pokazują clou krążka. KęKę udało się znaleźć wszystko to, czego szukał przez ostatnie lata, a było to bliżej niż się spodziewał…1. Rutyna (prod. 2K, APmg)2. Awdgb (gość Jaś, prod. Deemz)3. Na dłoni (gość Andrzej Grabowski, prod. @PSR)4. Samson (prod. @PSR)5. Brzmienie (gość Sarsa, prod. Sondr duet, gitara Paweł Smakulski)6. Zrobiłeś to, chłopak (prod. @PSR)7. Nic dodać, nic ująć (prod. @PSR)8. Nigdy ponad stan (prod. Sergiusz)9. Cesarz (prod. Boryrobibity)10. 1000 kcal. (prod. Michał Graczyk, 2K, Risk Zero)11. Zoba, zoba (gość Białas, prod. Young Veterans)12. Nie pytaj mnie o nic (prod. Michał Graczyk, scratch DJ VaZee)13. Serce matki (prod. soSpecial, gitara Paweł Semrau, scratch DJ Mono)14. Idzie wiosna (prod. soSpecial, gitara Paweł Semrau)', '', 'keke-to-tu', '', '', '', 'Kękę – To tu', '', '', '', ''),
(108, 1, 1, '„Trzecie rzeczy” to kolejny solowy album radomskiego rapera KęKę. Po uzyskaniu złotej płyty za debiutancki krążek „Takie rzeczy” i platynowego wyróżnienia za „Nowe rzeczy”, KęKę powraca aby domknąć cykl „rzeczy” i zapowiada, że będzie to ostatni album z tej serii oraz (wg słów artysty) najbardziej przemyślany i dopracowany z jego projektów.Raper nie zaprosił do współpracy żadnych innych wykonawców, co jest znakiem rozpoznawczym jego dotychczasowych albumów. Jego nagrania zyskują dzięki temu zabiegowi bardziej osobisty wymiar, nieprzefiltrowany przez wersy gości, a opowiadane historie i przemycane w tekstach emocje poruszają tłumy fanów rapera. Bo KęKę mówi dużo o sobie, ale tak naprawdę też o nas wszystkich.1. Cud2. Troski3. Smutek4. Nie mogło się udać5. Presja6. Na drodze7. Arrivederci8. Nie chcę umierać9. Nic już nie muszę10. Fala11. Miraż12. Miłość13. Podobno', '', 'keke-trzecie-rzeczy', '', '', '', 'Kękę – Trzecie Rzeczy', '', '', '', ''),
(109, 1, 1, '„Album „Knurion” powstał w cztery oderwane od codzienności weekendy. Pierwszy raz wpadłem na sesję do Grasshopper Studio w lipcu 2017 a ostatni w maju 2018. To były świetne chwile pełne zajawy i humoru, stąd na albumie króluje funk. Opiat za konsoletą, Panama z gitarą, ja nad kartką, wszyscy zanurzeni w gęstym dymie, szczęśliwi, zaangażowani i pełni pomysłów. Wyszedł z tej atmosfery kozacki muzyczny przelot, klimacik jest unikatowy i nie do powtórzenia, bo w sumie poznawaliśmy się w trakcie tworzenia tej płyty. W utworach czuć moc, choć po drodze różnie bywało, bo to jednak Polska. Dla mnie prywatnie klasyk, chciałbym nagrywać tylko takie rzeczy.” Kuba Knap\n1 CD Digipack + plakat w środku\nRap/tekst: Kuba KnapProdukcja: Opiat/PanamaRealizacja wokali: Grasshopper StudioMix/Master: Michał Eprom Baj', '', 'kuba-knap-knurion', '', '', '', 'Kuba Knap - Knurion', '', '', '', ''),
(110, 1, 1, 'Na albumie Kuby Knapa muzycznie możecie spodziewać się g-funkowych akcentów, ale również podkładów inspirowanych amerykańskim południem. Płytę, poza poza bonus trackiem dostępnym tylko w edycji specjalnej wyprodukował Jorgus Kiler. Całość została analogowo zmiksowana przez Antoniego Wróbla i zmasterowana przez Deszczu Strugi – asów z działającego na najwyższym poziomie OtraBarwa Studio. Mało? Wśród gości możecie spodziewać się między innymi: Ero i Kosiego z JWP, Zetenwupe i Ryfy Ri. Teksty raz zaskakują, innym razem frustrują, by po chwili rozbawić czy dać powód do rozkminy. Vaib to słowo klucz. Płyta buja, niezależnie czy temat utworu jest poważny, czy z przymrużeniem oka – Kuba jak zwykle w niewymuszony sposób wchodzi w bity po prostu dając dobro, rap pierwszej klasy. Funk nigdy nie zginie! O oprawę graficzną „Ludzie mówią różne rzeczy” zadbali Julia Knap oraz Tomek Miszkin. Kiedy ostatnio jakaś okładka tak przykuła Wasz wzrok? A spróbujcie wejść w historie ludzi, którzy na niej widnieją!', '', 'kuba-knap-ludzie-mowia-rozne-rzeczy', '', '', '', 'Kuba Knap - Ludzie mówią różne rzeczy', '', '', '', ''),
(111, 1, 1, '\"Blur\"- z ang.: niewyraźna plama, ale także rozmazać, zamazać, plamić, zamglić, zatrzeć. To trzecia płyta Małpy wydana po trzech latach solowej ciszy. \"Blur\" to album osobisty, intymny, przepełniony emocjami i nieskrępowaną szczerością. W całości wyprodukowany przez Magierę.1. Wisła skuta lodem2. Nie wiem co będzie jutro3. O krok4. Wszystko o czym śnię5. Zanim zaczął się czas6. W środku nocy7. Neofici8. Budzę się9. Puste słowa10. Pasażer11. Lonely (Outro)', '', 'malpa-blur', '', '', '', 'Małpa - Blur', '', '', '', ''),
(112, 1, 1, 'Małpa powraca na scenę muzyczną długo oczekiwanym, solowym materiałem. Po sześciu latach od wydania klasycznego już debiutu „Kilka numerów o czymś”, wydawnictwo Proximite prezentuje jego drugi album, na który składa się 13 utworów, zawierających część z tych przemyśleń, które kłębiły się w głowie rapera w ciągu ostatnich lat. Jego fani zaczęli przyzwyczajać się do tego, że milczy. Na szczęście jednak Małpa „Mówi”.\n\nTracklista:\n01. 80802. Naiwniak03. Miodu i mleka04. Parabole05. Lego06. Mołotow07. Jedyna słuszna droga08. Po sygnale09. Próby, błędy10. Wysoki Sądzie11. Satelity12. CSS13. Nie byłoby mnie', '', 'malpa-mowi', '', '', '', 'Małpa - Mówi', '', '', '', ''),
(113, 1, 1, 'Mata – 100 dni do matury\nMata rusza na podbój rapowej sceny. Po epce i multimilionowych singlach nadszedł czas na oficjalny debiut młodego rapera znad Wisły.\nPłyta „100 dni do matury” to najlepsza pamiątka z czasów szkolnych jaką artysta mógł sprezentować sobie i słuchaczom. Krążek jest zapisem historii i emocji, które przewijały się podczas beztroskich czasów edukacji. Wśród czternastu utworów znajduje się burzliwe życie młodego człowieka, spisane w sto dni, od studniówki do ostatnich chwil przed maturą.\nDebiut Maty przybliża klimat szkolnych lat. Nawiązuje on do czasów beztroskich a zarazem pełnych wyborów, wątpliwości i odkrywania samego siebie. Wspomnienia wraz z całą paletą emocji stanowią trzon płyty i są największą inspiracją dla Maty. Na płycie aż kipi od retrospekcji a wszystko łączy się z charakterystyczną dla autora autoironią i dystansem do siebie i świata. Mata dotyka również cięższych tematów. Porywa się na obalenie mitu grzecznych chłopców z dobrych domów i rzuca na ich wyidealizowany obraz zupełnie nowe spojrzenie. Album burzy stereotyp rapera z blokowiska i pokazuje, że “dzieciaki z willi” też mogą mieć coś do powiedzenia, potrafiąc przy tym doskonale rapować. \nWarstwa muzyczna to błyskotliwy, zabawny i bezkompromisowy rap na boombapowych bitach w połączony z wielowymiarowym stylem i newschoolowym sznytem rapera z Warszawy. Połączenie to tworzy nowe pole eksploatacji gatunku. To swoisty mariaż świeżości z klasyką, którego wypadkową jest „nowy oldschool”.\nAutorem zdjęcia okładkowego jest Piotr Pytel.\nPremiera sklepowa 17 stycznia 2020.\nTracklista:\nIntro (do nauki)Biblioteka trapPiszę to na matmieKonkubinatHomo ludensCafe PRLTangoPatointeligencjaHalellujah (cover) Żółte flamastry i grube katechetki Mata Montana Lezore Wino Sangrita (s01e01) Nero GOMBAO 33 100 dni do matury BONUS TRACK: Schodki BONUS TRACK: Prawy do Lewego', '', 'mata-100-dni-do-matury', '', '', '', 'Mata - 100 dni do matury', '', '', '', ''),
(114, 1, 1, 'Mata - Młody Matczak', '', 'mata-mlody-matczak-standard', '', '', '', 'Mata - Młody Matczak (standard)', '', '', '', ''),
(115, 1, 1, ' \nMoli jest prawdopodobnie jedynym polskim raperem, który z czystym sumieniem może mówić, że w jednej ręce trzyma mikrofon, a w drugiej karabin i nikt nie zarzuci mu braku autentyczności. Zawodowy żołnierz w stopniu szeregowego, ale doświadczony przez życie jak niejeden weteran, wydaje swój debiutancki album, by tytułowe spadające gwiazdy zamienić w spełnione marzenia.\n“Jak spadały gwiazdy” to wzruszająca, momentami brutalna i obrazoburcza historia wrażliwego i zagubionego chłopaka mierzącego się z ponurą rzeczywistością Polski “B”, z której chce się wyrwać. Droga do wymarzonego kontraktu płytowego i pierwszego legalnego wydawnictwa wiodła go przez przestępczy półświatek, nieudane związki i zawiedzione zaufanie, co w konsekwencji doprowadziło do poważnych problemów z używkami oraz trwałego uszczerbku na zdrowiu psychicznym i fizycznym. Moli poznał smak krwi, zapach szpitalnej pościeli i prawie dotknął nieba, choć akurat w jego przypadku oznaczało to bycie o krok od śmierci. Z samego dna na powierzchnię wyciągnęły go ręce rodziców i przy ich wsparciu zdecydował się na wstąpienie do wojska, gdzie początkowo wieloletnie kompleksy i lęki zwykłego chłopaka z Inowrocławia tylko się pogłębiły. Z biegiem udało mu się znaleźć w sobie siłę do zerwania ze starym, w wielu aspektach przepełnionych patologią życiem, oraz motywację do odmienienia swojego losu, a sen o karierze muzycznej wreszcie się ziścił. Na pierwszej płycie Moliego wesprą wokalnie White 2115, Kuqe 2115, Cooks oraz Janusz Walczuk i Floral Bugs - niedawno ogłoszeni Młodymi Wilkami 8. edycji akcji organizowanej przez portal Popkiller.\nDebiutancki album Moliego to opowieść o pogoni za marzeniami i nieustannej walce o lepsze jutro, w której największą przeszkodę może stanowić sam człowiek i podejmowane przez niego decyzje. To płyta dla każdego, kto boryka się z brakiem wiary we własne możliwości, dodatkowo potęgowanym przez negatywny wpływ otoczenia. “Jak spadały gwiazdy” to także dowód na to, że dzięki ciężkiej pracy i wsparciu najbliższych można osiągnąć zamierzony cel. Popatrz na okładkę i pomyśl życzenie.\nTracklista:\n \n\nEm\nPolski Chav\nNocne Światła\nZłe Towarzystwo ft. Kuqe 2115\nPąki Białych Róż\nNie Widzieli\nMr. Deeds ft. White 2115\nJupikajej\nWrap\nEkwipunek ft. Janusz Walczuk\n#perfectlife\nRiddikulus ft. Floral Bugs\nCo Narobiłaś\nNa Pół\nJak Spadały Gwiazdy\nHey', '', 'moli-jak-spadaly-gwiazdy-standard', '', '', '', 'Moli - Jak spadały gwiazdy (standard)', '', '', '', ''),
(116, 1, 1, 'Neile - Kicktape 2.0\nWydanie: Super jewel\nbox \nNa pierwszym\n\"Kicktape\" Neile szukał nowych rozwiązań i na nowo \"uczył się\nrapować\", dobrze się przy tym bawiąc. Przy \"Kicktape 2.0\" raper\nznalazł te rozwiązania i opanował nowe patenty, a kluczem okazała się właśnie\nzabawa wynikająca z tworzenia i spokój jaki towarzyszył mu przy powstawaniu\ntego materiału. \nArtysta ciężko\npracował nad wypracowaniem w sobie tego spokoju, nie zważając na przeciwności\nlosu i codzienne problemy natury egzystencjalnej. \n- Jest to materiał\nczłowieka, który nigdy nie zwątpił w to co robi. Przekonałem się, że wszystko\nczego potrzebuję już posiadam i mogę to rozwinąć, a rzeczy, które uważałem za\nsłabości stały się moją siłą. Nie czuję ogromnej potrzeby mówienia o tym, w\nsposób oczywisty na albumie. Pomiędzy wierszami umieszczam odpowiedzi, które\nznalazłem przez ostatnie lata. Na wierzch wyciągam także, swoje inspiracje\nsztuką i popkulturą. Stworzyłem też kilka postaci/moich alter ego, obok których\nciężko będzie przejść obojętnie. Wszystko tworzyłem na czuja, intuicyjnie, bez\nkalkulacji - tak Neile kometuje \"Kicktape 2.0\".\nNa płycie znajdzie się\n13 premierowych utworów na autorskich bitach. \nTracklista:\n1. Bogaty Ziomek\n(prod. Wizard) \n2. Hakuna Matata 2.0 (prod. K4M Beats) \n3. Telefon (prod. M8Beatz) \n4. elieN (prod. Latinio) \n5. Wyjdzie Bokiem (prod. HVZX) \n6. Biorę / Daję (prod. Wizard) \n7. Przerwa (prod. K4M Beats) \n8. Juicy Salif (prod. CatchUp) \n9. Pogo (prod. Sinima Beats) \n10. Kinder Bounce (prod. BLBeatz) \n11. Ostatni Krzyk Mody (prod. BLBeatz) \n12. Dotyk Midasa (prod. Got Barss)', '', 'neile-kicktape-20', '', '', '', 'Neile - Kicktape 2.0', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(117, 1, 1, 'Album \"7\" powstawał nieprzerwanie od czerwca 2005 r., a więc od zakończenia przez Ostrego prac nad albumem POE. Pod względem muzycznym Ostry jako producent zerwał z samplowaniem na rzecz autentycznie własnych kompozycji. Komponując i grając nowe produkcje nie uciekał się jednak do żywych instrumentów, lecz posłużył się swoją nową zabawką: syntezatorem K-Station (90% produkcji) oraz subsydiarnie samplerami MPC 60 i MPC 1000. Dzięki oparciu się na własnych kompozycjach, Ostry uważa album \"7\" nie tylko za najbardziej dopracowaną ze swoich płyt, ale także za oddającą w największym stopniu jego osobiste aspiracje, zamierzenia i plany dotyczące materiału. Jest to dzieło samo w sobie zupełne i zamknięte. Brak sampli powoduje, że muzykę z \"Siódemki\" trudno będzie utożsamiać ze znanymi jazzowymi inspiracjami Ostrego, jednak mimo posługiwania się współczesną elektroniką Ostry zachował na płycie funkową konwencję lat 70\'ych i na tym właśnie polega oryginalność nowego albumu - zarówno na tle jego pierwszych dwóch płyt jak i (jakże odmiennych) dwóch ostatnich albumów \"jazzowych\".Pod względem tekstowym \"7\" to concept album. To przejrzysta opowieść o życiu Ostrego, jego kolegów oraz o świecie, jaki ich otacza. Zwarty storytelling oparty jest na przeżyciach typowego polskiego dwudziestokilkulatka, który właśnie tak naprawdę wydoroślał i musi uporać się zarówno z obciążeniami jakie leżą na nim za sprawą starego systemu jak i z barierami jakie stawia przed nim nowy systemGościnnie na albumie występują: DJ Haem, który po raz kolejny osiągnął top krajowych możliwości, Tame One z kultowego dla części słuchaczy Hiphopu zespołu The Artifacts, grupa Skill Mega (angielscy przyjaciele Ostrego) oraz Kochan, Zeus i Hryta.\nTrack lista:\n1. Intro2. Uwolnij to w sobie3. Klub4. Biegnij5. Mówię co widzę6. Złość7. Rugby gościnnie Kochan (Tabasko)8. O robieniu bitów9. Otwieram drzwi10. Milion Euro11. Wydaj mnie gościnnie Hryta12. Opowieść13. Kioskowy skit14. Polskie komedie15. ... (zapomniałem tytułu)16. Więcej decybeli by zagłuszyć... gościnnie Zeus17. PRL kontrast18. Co się u nas dzieje19. Perfect City gościnnie Tame One + Dan Fresh and Reps Of Skill Mega20. Czy warto21. Jedna chwila22. Ku krytyce', '', 'ostr-7', '', '', '', 'O.S.T.R. - 7', '', '', '', ''),
(118, 1, 1, 'Track lista:\n#1\n1. Jazz nocnym rytmem2. Początek...3. Co ty tu robisz? / DJ Haem4. Boże igrzysko cz. 2 / gitara: Marek Dulewicz5. Bałuty... / DJ Romek6. Problemy / DJ Kostek7. Nie lubię poniedziałków8. Luzzzzz9. Rap po godzinach / DJ Haem10. Życie / DJ Haem, bass: O.S.T.R.11. W oceanie zmysłów / DJ Haem12. Wszystko co mam / DJ Haem13. Korzenie / DJ Haem14. ...15. Program / DJ Kostek16. Z-Łodzi-eje / DJ Kostek17. Znam to / DJ Haem18. Człowiek z przyszłości19. Jak być... ? / DJ Kostek20. Jazz w wolnych chwilach (Ziom odpocznij) / DJ Haem\n#2\n1. Huana / DJ Haem2. 30 sekund / DJ Haem3. Wechikuł czasu / DJ Haem4. Dwie strony gry / DJ Haem5. Gangsterskie opowieści / DJ Kostek6. Słowo to siła / DJ Haem i DJ Kostek7. Patent na luxus / DJ Haem8. Luzzzzz9. 4 Elementy / DJ Funksion10. Hajabuza11. Skazany na RAP / gitara: Marek Dulewicz, DJ Kostek12. Zamach stanu13. Sztuka ulicy / DJ Haem14. Labirynt15. Blok / DJ Kostek16. Mówisz...17. Autobiografia / DJ Haem18. Nic pod publike / DJ Kostek19. Cisza przed burzą20. Kiedy mnie z tego zabierzesz / DJ Haem21. Samotność / skrzypce: O.S.T.R22. Tabasko: Pokoje', '', 'ostr-jazz-w-wolnych-chwilach-2cd', '', '', '', 'O.S.T.R. - Jazz w wolnych chwilach 2CD', '', '', '', ''),
(119, 1, 1, 'Track lista:\n1 . Dym2 . Jazzurekcja3 . Odzyskamy Hiphop4 . Kilka wersów do ludzi5 . Dla zakochanych6 . Bajera7 . Apacz8 . Poszukiwacze wosku9 . Państwo10 . Mam plan11 . Mózg12 . Małe piwo13 . Historia14 . Nie ważne15 . W nasłuchwianiu ciszy16 . Komix17 . Tajemnica skreczy18 . Zoom19 . Karambol20 . Sen21 . To jest nasze22 . Planeta Jazzu', '', 'ostr-jazzurekcja', '', '', '', 'O.S.T.R. - Jazzurekcja', '', '', '', ''),
(120, 1, 1, 'O.S.T.R. to dość oryginalna postać na rodzimej scenie hip hopu. Z jednej strony zdolny MC, uchodzący za najlepszego w Polsce freesty leowca, z drugiej - skrzypek, student Akademii Muzycznej w Łodzi. Płyta \'Masz to jak w banku\' jest jego solowym debiutem, charaktery zujący się przede wszystkim nienagannym warsztatowo, specyficznym stylem wokalnym.\nTrack lista:\n1. Intro2. Ot3. Kiedy4. Kakafonia5. ABC6. Ja to p...!7. Świata kwietnik8. Masz to jak w banku9. Z...10. Yebać11. Widzisz błąd12. Dzień po dniu13. 1001 Kovier14. Płonie (skit)15. Profesja16. Salsa17. P.E.C.H.18. Ile jestem w stanie dać19. Nie ma tego złego20. Hał (skit)21. O.S.T.R.', '', 'ostr-masz-to-jak-w-banku', '', '', '', 'O.S.T.R. - Masz to jak w banku', '', '', '', ''),
(121, 1, 1, 'Track lista:\n01. Masz to jak w banku 2 (gościnnie: Nova)02. To nie jest tak03. Kochana Polsko04. Szukam stylu (gościnnie: Maku)05. Zazdrość06. Zrób sobie wolne - skit07. Tabasko08. Miejska ślepota09. Sram na media (gościnnie: M.Orłoś, Fenomen, Spinache)10. Grzech za grzech11. $12. Ja i mój lolo13. Ból doświadczeń (gościnnie: Vienio)14. Biznes15. Echo miasta (gościnnie: Pezet)16. 1 na 10017. Ziom za ziomem (gościnnie: Tede)18. Rachunek sumienia19. Tabasko (Kochan, O.S.T.R., Tomila): Czas i pieniądz (bonus track)', '', 'ostr-tabasko', '', '', '', 'O.S.T.R. - Tabasko', '', '', '', ''),
(122, 1, 1, '\"10/29\" czyli 10 album napisany w wieku 29 lat oraz stary adres Palucha, blok 10 mieszkanie 29.Na krążku znajduję się 18 premierowych utworów wyprodukowanych przez takich producentów jak: Julas, Grrracz, duet Chris Carson/Kendo czyli Young Veteran$, SoDrumatic, SherlOck oraz słowacki producent Maiky Beatz. Gościnnie pojawiają się raperzy z Europy: Rytmus (Słowacja), Olexesh (Niemcy), S.Pri Noir (Francja) oraz członek BOR - Gedz. W jednym z refrenów udzielił się także Ras Luta.Na gramofonach projekt wsparli Dj Taek, Dj Showoraz, Dj VaZee. Motyw z okładki to charakterystyczne dla Piątkowa (dzielnica Poznania z której pochodzi raper) dwie wieże RTV, które można dostrzec prawie z każdego punktu miasta.\n01. Po właściwej stronie prod. Julas02. 10/29 prod. Julas feat Dj Taek03. OneWay OneLove OneCrew feat Ras Luta prod. Grrracz04. Taki jestem prod. SoDrumatic05. Zostało w nas feat Olexesh, Dj Show prod. Maiky Beatz06. Co na to Paluch? prod. Julas07. Halo Ziemia prod. Julas08. Przyziemne Sprawy feat Rytmus prod. Grrracz09. Swoje Miejsca prod. Grrracz10. W kawałkach prod. Julas11. Odpocznij prod. Julas12. Impuls prod. Grrracz13. Maniak feat Gedz prod. Young Veteran$14. Nerwy Stres (market love) prod. Julas15. Pierwszy Świat feat S.Pri Noir prod. Grrracz16. Czyste Złoto feat Dj VaZee prod. SoDrumatic17. Trzy prod. SherlOck18. Na spokojnie feat Dj Taek prod. Maiky Beatz', '', 'paluch-10-29', '', '', '', 'Paluch - 10/29', '', '', '', ''),
(123, 1, 1, 'Po świetnym 2016 roku w wykonaniu Palucha (dwa albumy - \"10/29\" platynowy i \"Ostatni Krzyk Osiedla\" podwójna platyna) raper nie zwalnia tempa i po równych 12 miesiącach wyda kolejny album pt.\"ZŁOTA OWCA\" który trafi do sprzedaży 24 listopada 2017r.Materiał będzie cięższy od swojego poprzednika, zarówno w warstwie lirycznej jak i muzycznej. Paluch porusza się między życiem prywatnym, rodzinnym często schodząc na tematy osiedlowe i mocno braggowe.Tytuł albumu oznacza przeciwieństwo do przysłowiowej czarnej owcy. Złota Owca jako przywódca stada, głowa rodziny, dobry duch.\nTrack lista:\n01. Złota Owca prod. Sergiusz02. Kontrola Jakości ft. Szpaku prod. soSpecial03. Głód prod. APmg04. Krótka Piłka ft. Sarius prod. WhiteHouse05. Lista w butelce prod. Sergiusz06. Mam ten luksus ft. Gedz, Kobik prod. Michał Graczyk07. Cardio prod. ENZU08. Plac zabaw prod. 2K09. DYM prod. Julas10. Sterylnie ft. Quebonafide prod. 2K11. Biohazard prod. Julas12. Zły sen prod. 2K13. Zimne ognie ft. Dj Taek prod Youn Veteran$', '', 'paluch-zlota-owca', '', '', '', 'Paluch - Złota Owca', '', '', '', ''),
(124, 1, 1, 'Nowe wydanie kultowego albumu Pezeta pt. „Muzyka rozrywkowa”. Album wzbogacony o drugą płytę, na której znajdzie się aż 13 remixów. Jak mówi Pezet:\n\"Muzyka Rozrywkowa to dla mnie bardzo ważna płyta. To moja pierwsza świadoma i ryzykowna zmiana stylistyki, odkupiona wiecznym narzekaniem ortodoksów. Z perspektywy czasu bardzo lubię tę płytę, dobrze wspominam pracę nad nią, chociaż nie przepadam za okresem w moim życiu, który ta płyta opisuje. To był bardzo imprezowy czas. Wielu zarzucało mi to, że treść tego albumu jest bezrefleksyjna i nawet przez chwilę im uwierzyłem, ale nie jest tak. Słyszę to szczególnie dobrze właśnie teraz po latach.\"\n\"Dziś już paru rzeczy bym w ten sposób nie napisał, bo były to wersy powiedzmy \"wywożonego gnoja z podwórka\". Jest też na tym albumie bardzo dużo, bardzo prostych hedonistycznym i wulgarnych tekstów o mocnym imprezowaniu, ale cóż zawsze było coś pociągającego w przekraczaniu granic i szybkim życiu chociaż definitywnie, w tej formie nie jest to żadna wyższa wartość. Były rzeczy, które w tym mocno lubiłem, niektóre lubię nawet do dziś, choć staram się od nich stronić, ale przede wszystkim dla mnie na prowadzenie wysuwa się w treści tej płyty pewna gorzka refleksja, gdzieś z tylu wciąż słychać, że to wszystko ja tak naprawdę lubię, że jest jakiś powód dla którego tak się stało, coś innego musiało się w moim życiu nie udać i wszedłem w ten chory świat, totalnego melanżu, szybkiego seksu, nieprzespanych nocy bo czułem, że nic innego, ważniejszego, lepszego nie ma szansy mnie spotkać. \nCieszę się bo moim zdaniem to zgorzknienie słychać. Co poza tym? To świetna jak tamten czas produkcja Szoguna. Bardzo udana warstwa muzyczna w której czerpał trochę z southowego rapu, ale nie wyszło z tego totalne xero, wyszło za to coś super. Do tego jeden z najlepszych beatów Kociołka. Nic dodać, nic ująć.\"\nW 2007 roku \"Muzyka rozrywkowa\" dotarła do 5. miejsca listy OLiS w Polsce. Nagrania uzyskały także nominację do nagrody polskiego przemysłu fonograficznego Fryderyka w kategorii Album Roku Hip-Hop / R&amp;B.\nReedycja zawierać będzie drugą płytę z remixami, którymi autorami są: Sempu, Tasty Beatz, L PRO, Szogun i Pln.Beatz, a gościnne zwrotki dograli Wuzet, Flint i Żaru (ParExcellence).1. #1 2. Halo 3. Na tym osiedlu gosc. Onar 4. Lubię 5. Nie tylko hit na lato 6. Pezet jak 7. Niegrzeczna 8. Noc i dzień 9. Mamy ten styl 10. Pornogwiazdy 11. Lojalność? 12. Sexmisja 13. Czterdziesciprocent 14. Takie jak ty 15. Gdyby miało nie być jutra', '', 'pezet-muzyka-rozrywkowa-2cd', '', '', '', 'Pezet - Muzyka rozrywkowa (2CD)', '', '', '', ''),
(125, 1, 1, 'Re-edycja klasyka polskiego hip-hopu z 2004 roku.\n\'Muzyka poważna\' to kontynuacja wspólnego projektu warszawskiego producenta NOON\'a i odpowiedzialnego za stronę tekstową Pezeta. Podobnie jak na płycie \'Muzyka klasyczna\' w pracy nad albumem wspomógł ich obsługujący gramofony DJ Panda. Podkłady zostały nagrane w studiu NOON\'a przy użyciu Akai MPC 2000 i monosyntha ARP Pro DGX. Całość została zmiksowana w studio 33 Obroty. Otrzymaliśmy w ten sposób szesnaście rytmicznie pulsujących kompozycji w których tekstowo dominuje temat przemijania i niespełnienia.\n01. (To) Tylko raz 0102. Intro03. (To) Tylko raz 0204. To-samo05. Retro 0106. Nie jestem dawno07. Wibracja 0408. Szósty zmysł09. Retro 0210. Cepelia11. A mieliśmy być poważni...12. W branży13. Gubisz ostrość14. Dziś15. Retro 0316. Nie jestem dawno (Ajron remix)17. Szósty zmysł (Webber remix)', '', 'pezet-noon-muzyka-powazna', '', '', '', 'Pezet/Noon - Muzyka Poważna', '', '', '', ''),
(126, 1, 1, 'Insomnia to album, który łączy w sobie wysokiej jakości rap z z lekkimi, marzycielskimi brzmieniami.Pierwsze legalne wydawnictwo PlanBe odsłania zarówno ciemną jak i jasną stronę nocnych przemyśleń artysty,okraszonych nostalgicznymi wspomnieniami przeszłości, rozmyśleniami o przyszłości i surowej analizy teraźniejszości.Dzięki swojej różnorodności, płyta z pewnością przypadnie do gustu nawet najbardziej wymagającym słuchaczom.CD1:\n1.GOMORRA prod.LANEK2.PAMIĘTAM prod.LANEK3.WIELE prod.LANEK4.A4 prod.LANEK5.INSTRUKCJE prod.LANEK6.NIE CHCĘ prod.HUBI7.SAM prod.APRILJOKE8.PISZĘ TEKST prod.LANEK feat.RETO9.XXL prod. CHDZK.CRVCRZ10.TINDER LOVE prod.LANEK11.PRZEZ SEN prod.LANEK feat.SZTOSS12.6 RANO prod.JACON\nCD2:\n1.WYRWAĆ SIĘ prod.FADED DOLLARS2.HOLLYWOOD$ prod.FELIEPE3.OLDSCHOOL prod.GOT BARSS4.MAMA, BĘDĘ WIELKI prod.LANEK5.TAŃCZ prod.FELIEPE6.NIE MUSZĘ PYTAĆ prod. B.MELO7.LUBIĘ prod. NOTIME8.DAJ MI prod.LANEK9.ONA TO ZIOMAL prod.NOTIME10. NA TYLNYCH SIEDZENIACH prod. CIAN.P11.DOBRANOC prod.JOHNNY BEATS', '', 'planbe-insomnia', '', '', '', 'PlanBe - Insomnia', '', '', '', ''),
(127, 1, 1, 'ALBUM W WERSJI STANDARD\nWydanie: digipack z książeczką z tekstami.\n„Egzotyka” to drugi, po pokrytej platyną „Ezoteryce”, album studyjny Quebonafide.\n„Egzotykę” wyróżnia niewątpliwie koncepcja. Krążek powstał podczas podróży po świecie, a każdy z 14 utworów inspirowany jest innym miejscem na Ziemi.\nPomimo jasnego motywu przewodniego, tracklista „Egzotyki” jest bardzo różnorodna: od emocjonalnych i osobistych kawałków, po świeże i nowoczesne bangery. \nW swoich utworach, Quebonafide porusza tematy związane nie tylko z kulturą i atmosferą odwiedzanych miejsc, ale również problemami społecznymi. Obecność międzynarodowych gości dodaje płycie autentyczności i wyjątkowego klimatu.\nTracklista:1. Oh my Buddha feat. Dj Flip2. Quebahombre3. Szejk4. Bollywood feat. Czesław Mozil5. Luis Nazario De Lima feat. Dj Ike6. Madagaskar7. Changa feat. Ifani8. C’est la Vie9. Zorza10. Między słowami feat. Young Lungs11. Arabska noc feat. Solar, Wac Toja12. To nie jest hip hop feat. KRS One13. Bumerang14. Odyseusz feat. Dj Flip', '', 'quebonafide-egzotyka-wersja-standard-1-cd', '', '', '', 'Quebonafide - Egzotyka (wersja standard 1 CD)', '', '', '', ''),
(128, 1, 1, 'ROMANTIC PSYCHO 2020 WERSJA EU\nTrack lista:\n1. ROMANTICPSYCHO2. JESIEŃ3. PRZYTOBIE4. SZUBIENICAPESTYCYDYBROŃ5. TĘSKNIĘZASTARYMKANYE6. ASPARTAM7. COJESTMAŁPY8. RUMPELSTILSKIN9. GAZPROM10. ŚWIATTOMÓJPLACZABAW11. AJETLAGTOMÓJNOWYDRAG12. TOKYO202013. NIEPŁACZĘPONOTREDAME14. ŁAJZA15. BUBBLETEA16. TOWSZYSTKOBYŁODLACIEBIE', '', 'quebonafide-romantic-psycho-wersja-eu', '', '', '', 'Quebonafide - Romantic Psycho (wersja EU)', '', '', '', ''),
(129, 1, 1, '„Hip-Hop 2.0” to wspólny album artystów zrzeszonych wokół labelu\nQueQuality i osoby Quebonafide. To kilkanaście utworów prezentujących\numiejętności i styl nowej fali młodych raperów, którzy z dnia na dzień co raz\nbardziej przebijają się do świadomości słuchaczy. \n„Młoda fala raperów coraz odważniej radzi sobie na scenie. Mając\nswobodny dostęp do nowych technologii, mogą tworzyć i nagrywać praktycznie bez\nograniczeń, inspirując się muzyką z całego świata. To ta różnica dzieląca ich\nod o 20-lat starszych kolegów, którzy mieli znacznie trudniejszy start. Tytuł\n„Hip-Hop 2.0” nawiązuje właśnie do tej sytuacji.” – usłyszeliśmy w QueQuality.\nPołowa płyty to utwory zarejestrowane przez Quebonafide, do\nktórych ciechanowski wykonawca zaprosił w gościnnej roli młodych MC. Druga\nczęść składanki to solowe nagrania artystów współpracujących z QueQuality. Na\npłycie znajdziemy takie ksywki jak Deys, Emes Milligan, Guzior, Kartky,\nIgrekzet, Szesnasty, Wac Toja, PlanBe, NieznanyKlarenz oraz inni.\nOkładka została zaprojektowana przez Grzegorza „Forina”\nPiwnickiego. \nTracklista:\n01. Quebonafide - QueQuality (prod. Got\nBarss, cuty DJ Flip) \n02. Guzior - Ōmori Ōmori (prod.\nSecretRank) \n03. Deys – Cera (prod. Apriljoke) \n04. Quebonafide – All Black (prod. Young\nVeteran$) \n05. Igrekzet – O2 (prod. NoTime) \n06. Nieznanyklarenz – Prawie znany (prod. SiwySiwek) \n07. Quebonafide ft. Wac Toja – Asceta (prod. Young\nVeteran$) \n08. PlanBe – Na dłoni (prod. GeezyBeatz) \n09. Szesnasty ft. Fiłoń – Szczypta (prod. Morte) \n10. Wac Toja – Klik Klik Bang (prod. TRFN) \n11. Quebonafide ft. Krzy Krzystof – Wesoła Ekipa (prod.\nSoDrumatic, cuty DJ Flip) \n12. Kartky x Emes Milligan – Naprawdę (prod. Airflake) \n13. Kaz Bałagane x 2sty – Jeden strzał (prod. GeezyBeatz, cuty DJ Flip) \n14. EMAS ft. Kobik –\nNie mogę tego spierdolić (prod. EljotSounds) \n15. Filipek – Persona Non Grata (prod. Teken) \n16. Quebonafide ft. Solar, Ania Iwanek – Święty spokój\n(SoDrumatic Remix) ', '', 'quebonafide-i-quequality-hip-hop-20', '', '', '', 'Quebonafide i QueQuality – Hip-Hop 2.0', '', '', '', ''),
(130, 1, 1, '\"Mam 30 lat, dwie ręce, dwa jaja, jedną głowę i przestałem udawać dziecko. Razem z Kamilem zrobiliśmy płytę dla mentalnie dorosłych, bez względu na to w jakim są wieku. To nasz najbardziej świadomy album. Historie tutaj opowiedziane są albo oddaniem 1:1 sytuacji w których się znalazłem, albo relacją z miejsca gdzie dorastałem albo zainspirowane są życiem bliskich mi osób. Wszystkie numery powstały od podstaw na naszych wspólnych sesjach w studio. Nie było \"wysyłania bitów\". Od początku nagrań nie mieliśmy w głowie żadnej daty premiery, żadnego deadlinu od wydawcy, żadnej presji oczekiwań. Po prostu ją nagraliśmy. Gości nie jest dużo, ale tylko oni mogli dotrzymać tempa, o które nam chodziło. Mamy nadzieję, że ludzie słuchając tego albumu będą czuli się tak, jakby poszli do kina na \"Listy do M\", a naprawdę obejrzeli \"Szósty zmysł\". 1985 to nasz rocznik.\nTrack lista:\n01. Zima (feat. Otsochodzi)02. Przezroczysta krew03. Co mi zrobisz?04. Czarne koty05. Nowa miłość06. Ale zdejmij buty (feat. Ten Typ Mes)07. 198508. Wszyscy kłamią09. Jak z nut10. Drugie życie przed snem11. Na pół12. Jeszcze jeden kieliszek13. K. (feat. Pan Tubas)14. Przerwa', '', 'rasmentalism-1985', '', '', '', 'Rasmentalism - 1985', '', '', '', ''),
(131, 1, 1, '“Tango\" to miejska historia miłosna. Oparta na przeżyciach własnych i cudzych. Zamknięta w 11 częściach, otwarta na dowolne interpretacje. Dla nas to świadoma zabawa formą i radość z muzyki, mamy nadzieję, że dla was także. Tańczmy, można mylić kroki.Płyta w wersji standard\nTrack lista:\n01. Niebo02. Tranquilo03. Fast food04. Tango05. Stanie w kolejce06. Palma07. Kilka dni08. Serio09. Tryb samolot feat. Vito (Bitamina)10. Duch11. Indygo', '', 'rasmentalism-tango', '', '', '', 'Rasmentalism - Tango', '', '', '', ''),
(132, 1, 1, 'Albumem \"Wyszli coś zjeść\" puszczamy oko do czasów, kiedy powstawał nasz ulubiony rap. Kanye West nie chodził z lustrem pod ręką, chłopaki z Outkast byli świeży i czyści, Talib Kweli i Hi-tek mieli wspólny tok myślenia, a Cam\'ron wcale nie wyglądał tak głupio w fioletowym. Dorzucamy do tego sporo Rasmentalismu i idziemy coś zjeść.Na płycie pomagają nam: Tort (klawisze w numerach 10 i 11), DJ Ike (cuty w numerze 1), Rafał Gańko (trąbka w numerze 13) i Sławek Uniatowski (klawisze w numerze 12).Produkcja muzyczna, realizacja nagrań: Ment XXL.Rap, teksty: Ras i Goście.Miks i mastering: Marek Dulewicz / Embryo Nagrania.\nTrack lista:\n01. Budzik na 13:0002. Wyjdziesz na dwór? feat Quebonafide03. Ryzyko wróg najgorszy04. Nie jest tak feat Sokół05. Mur przy wolnym06. Na horyzoncie feat Tomson07. System interwałów feat Klaudia Szafrańska08. Nocny09. Film o nikim10. Nie jestem raperem feat Dwa Sławy, The Voices11. Byłoby łatwiej12. Dna butelek feat Sławek Uniatowski13. On nie ja feat Sarius14. Świat zwariował w 29 lat', '', 'rasmentalism-wyszli-cos-zjesc', '', '', '', 'Rasmentalism - Wyszli coś zjeść', '', '', '', ''),
(133, 1, 1, 'Hotel Maffija to powstający na bieżąco projekt muzyczny.\nPomysł wspólnego wyjazdu kłębił się w głowach SB Maffijczyków od co najmniej kilku lat, ale okoliczności nigdy na to nie pozwalały. Z pomocą przyszły odwołane koncerty. Ekipa wyjechała na Kaszuby, wynajęła dom i zbudowała na miejscu dwa studia polowe. Wszystko powstało na bieżąco od muzyki, przez video, oprawę graficzną po to co działo się w internecie. Przygody SB Maffiji zarejestrowała kamera a wszystko mogliście śledzić w internecie.\nData premiery będzie opublikowana tak szybko jak to możliwe. Więcej informacji wkrótce.\nWYDANIE STANDARD', '', 'sb-maffija-hotel-maffija-wersja-standard', '', '', '', 'SB Maffija - Hotel Maffija (wersja standard)', '', '', '', ''),
(134, 1, 1, 'Gorączka Sobotniej Nocy to drugi album szczecińskiego rapera SOBOTY z wytwórni StoproRap, który po udanym debiucie płyty Sobotaż, tym razem jeszcze wyżej postawił sobie poprzeczkę.Za produkcję w całości odpowiada Matheo.Producentem wykonawczym jest Winicjusz Bartków.Na płycie gościnnie wystąpili: Chada, Chór Montu, Czapka, Matheo, Paluch, Panna Quan, Peja, Pih, Rena, Rufijok, Sage, Smagalaz, Starszy, Tede, Tony Jazzu, Wini.Skrecze: Dj FEEL-X, Dj Decks.Gorączka Sobotniej Nocy to drugi album szczecińskiego rapera SOBOTY z wytwórni StoproRap, który po udanym debiucie płyty Sobotaż, tym razem jeszcze wyżej postawił sobie poprzeczkę.Za produkcję w całości odpowiada Matheo.Producentem wykonawczym jest Winicjusz Bartków.Na płycie gościnnie wystąpili: Chada, Chór Montu, Czapka, Matheo, Paluch, Panna Quan, Peja, Pih, Rena, Rufijok, Sage, Smagalaz, Starszy, Tede, Tony Jazzu, Wini.Skrecze: Dj FEEL-X, Dj Decks.Za miks i master odpowiedzialny jest Sebastian \"madmagister\" Witkowski.Płyta w stosunku do poprzedniej jest bardziej spójna muzycznie, choć nie jest wolna od eksperymentów. Można na niej znaleźć przekrój brzmień: od elektronicznych, poprzez żywe instrumenty, po dźwięki zahaczające nawet o folk.Wszystko wymieszane w wyważonych proporcjach i określające wyjątkowy muzyczny styl zarówno Matheo jak i SOBOTY. Płyta jest również wielogatunkowym projektem pod wspólnym mianownikiem hip hopu, który ma za zadanie kreować trendy w muzyce, a nie być tworem wzorowanym na nich.Graficzną stroną projektu zajął się główny designer Stoprocent GuruGomez.Zdjęcia wykonał Adam Fedorowicz.SOBOTA GORĄCZKA SOBOTNIEJ NOCYTrack lista:IntroZabroń miMój czas feat. Matheo, StarszyMój domNic się nie zrobi samoPrzedstawienie musi trwaćUcieczka gośc. Rufijok (skrecze dj FEEL-X)Naprzód gośc. Paluch, Slums Attack, Panna Quan (skrecze dj Decks)Do góry łeb gośc. Chór MontuCzuję się dobrzeGorączka sobotniej nocyPrzekaz gośc. TedeSkitWolny mikrofonNiech ktoś mi kurwa powie gośc. Smagalaz, WiniZimny drańNumer na życzenieEra frajera gośc. Czapka (skrecze dj FEEL-X)Szczecin gośc. Spółdzielnia (skrecze dj FEEL-X)Bez odwrotu gośc. Pih, ChadaJesteś już mój, jesteś już moja', '', 'sobota-goraczka-sobotniej-nocy', '', '', '', 'Sobota – Gorączka sobotniej nocy', '', '', '', ''),
(135, 1, 1, 'Po trzech albumach nagrodzonych złotymi płytami przyszedł czas na czwarty w karierze Soboty. Za produkcję muzyczną oczywiście odpowiada Matheo. Płyta jest bardzo zróżnicowana. Słuchacze znajdą tam inspiracje bluesem tak jak w utworze „Bandycki Raj”, sporo elektroniki, jak również rocka.Muzyka bardziej nawiązuje do pierwszej płyty „Sobotaż”. Znajdziemy tam też dużo instrumentów granych na żywo, fuzji z artystami spoza środowiska hip hopowego. Jest podsumowaniem poprzednich płyt i zarazem zamknięciem trylogii, ponieważ jest ostatnią, która będzie miała w tytule „Sobota”.Na albumie można usłyszeć takich gości jak: Piotr Klatt (Róże Europy), Auman (Frontside), Lukasyno oraz ekipa Stoprocent: Matheo, Rena, Bonsona i Wini.Track lista1. Mówią o mnie2. Czekając na Sobotę gośc. Rena3. Hej jak leci4. Moje ziomki wciąż5. Jedwab gośc. Piotr Klatt (Róże Europy)6. Łatwo powiedzieć gośc. Wini, Rena, Bonson, Matheo7. Gwiazda rocka gośc. Auman (Frontside)8. Chciałbyś...9. Przepraszam10. Bandycki raj11. Dirty dancing12. Jestem stąd gośc. Lukasyno13. Ty już nie jesteś sam14. W wielkim skrócie', '', 'sobota-sobota', '', '', '', 'Sobota – Sobota', '', '', '', ''),
(136, 1, 1, 'Pierwszy solowy album szczecińskiego artysty reprezentującego Ogarnijsie.pl, Soboty \'Sobotaż\' to dopracowana kompozycja innowatorskiego hiphopowego brzmienia.Krążek jest połączeniem różnorodnych podkładów, wyprodukowanych przez znanego i docenianego nie tylko w kraju, ale także za oceanem producenta Matheo.Płyta bogata w funk, instrumental, brzmienie gitar i perkusji- daje efekt utworów zarówno imprezowych, które zachęcają do zabawy na parkiecie jak i tych, które budują klimat do opowieści o życiu i trafnych spostrzeżeniach rapera, pozwalających na chwile refleksji.Charyzmatyczny styl, różnorodne brzmienie, chwilami groteskowe teksty dostarczą słuchaczom chwile dobrej zabawy jak i pozwolą na odrobinę relaksu.Track lista1. Mówią o mnie2. Czekając na Sobotę gośc. Rena3. Hej jak leci4. Moje ziomki wciąż5. Jedwab gośc. Piotr Klatt (Róże Europy)6. Łatwo powiedzieć gośc. Wini, Rena, Bonson, Matheo7. Gwiazda rocka gośc. Auman (Frontside)8. Chciałbyś...9. Przepraszam10. Bandycki raj11. Dirty dancing12. Jestem stąd gośc. Lukasyno13. Ty już nie jesteś sam14. W wielkim skrócie', '', 'sobota-sobotaz', '', '', '', 'Sobota – Sobotaż', '', '', '', ''),
(137, 1, 1, '\"Wojtek Sokół\" to pierwszy w pełni solowy album Sokoła.Na płycie usłyszymy trzynaście całkowicie premierowych utworów oraz gości stanowiących pierwszą ligę i przekrój współczesnej muzyki rozrywkowej, alternatywnej oraz oczywiście - hip-hopowej. Sokół stawia na różnorodność pod każdym względem - od grona zaproszonych do współpracy producentów i ich muzycznej stylistyki, po klimat każdego z utworów. Do tego - jakość, liryczna pomysłowość i nieprzewidywalność narracji, do której przez lata przyzwyczaił publiczność Sokół.Taco Hemingway, PRO8L3M i Hewra - to goście płyty reprezentujący hip-hopową część sceny. W refrenach utworów usłyszymy najciekawsze głosy młodego pokolenia muzyki rozrywkowej takie jak: Igo znany z zespołu Clock Machine i duetu z Bass Astral, Lena Osińska z zespołu Sonar czy finalista The Voice of Poland - Mateusz Krautwurst. Na płycie znajduje się również utwór z wykorzystaniem głosu zmarłego tragicznie w 1991 roku legendarnego polskiego wokalisty Andrzeja Zauchy. Grono producentów zaproszonych do stworzenia albumu łączy reprezentantów sceny elektronicznej i alternatywnej. Usłyszymy takich artystów jak Pejzaż (Bartosz Kruczyński, znany z duetu Ptaki) czy Duit. Tuż obok znajdą się przedstawiciele współczesnej sceny rapowej jak Steez83 czy WOWO, a także berliński duet producencki Broke Boys i legendy takie jak Magiera czy DJ B.\nTrack lista:\n01. Hybryda (prod. WOWO, cuty: Steez83)02. Lepiej jak jest lepiej feat. Mateusz Krautwurst (prod. Magiera)03. Pluszowy (prod. Lutosław Granat)04. Pomyłka feat. Andrzej Zaucha (prod. Pejzaż, cuty DJ Kebs)05. Sprytny Eskimos feat. Igo (prod. Magiera)06. I Tak I Nie feat. Hewra (prod. ?)07. Za Ręce (prod. Duit)08. Nie Da Na Da feat. Marcin Pyszora (prod. Broke Boys)09. Napad Na Bankiet feat. PRO8L3M, Taco Hemingway (prod. Steez83)10. Z Tobą (prod. DJ B)11. Skażony (prod. Emowski)12. MC Hasselblad (prod. Dryskull)13. Koniec Gatunku feat. Lena Osińska (prod. WOWO)14. Chcemy Być Wyżej (prod. Zeppy Zep, cuty Steez83) Bonus track', '', 'sokol-wojtek-sokol', '', '', '', 'Sokół - Wojtek Sokół', '', '', '', ''),
(138, 1, 1, 'solar - klub 27 (prod. deemz)\nPREMIERA PŁYTY: 8 GRUDNIA 2017\nGOŚCINNIE NA KRĄŻKU POJAWILI SIĘ: QUEBONAFIDE, BIAŁAS, PALUCH, BETEO ORAZ ZUI. \nMimo że ciężko nazwać Solara debiutantem, \"Klub 27\" to jego pierwszy solowy album na legalu. Choć lata pracy w podziemiu i w oficjalnym obiegu zaowocowały wielkim sukcesem SB Maffiji, raper postawił na szczerość i zamiast propagandy sukcesu przygotował materiał \"jakby w bani ktoś założył podsłuch\".\nArtystyczna sinusoida jest nieubłagana niezależnie od osiągniętego statusu. Długo wyczekiwany sukces potrafi zarówno karmić ambicję i wzmacniać determinację, jak i przynosić gorzką refleksję. W 27 roku życia Solar zmierzył się z mnogością trudnych tematów, o których zazwyczaj nie mamy okazji słuchać na rapowych albumach. Wers \"będzie po mojemu albo będzie po mnie\" potraktował stuprocentowo serio.\n\"Klub 27\" to huśtawka nastrojów, którą swoją muzyką zobrazował Deemz, autor wszystkich podkładów na albumie. Producent znany ze współpracy z takimi artystami jak Paluch, Quebonafide, Sitek, Białas, KęKę czy ReTo wykorzystał nowoczesne trendy nie by stawać w wyścigu na najlepszą adaptację, ale żeby przekuć je w autorski pomysł. Muzykalność krążka doskonale uzupełnia wypracowany latami skill w posługiwaniu się auto-tunem i wokalnymi efektami w swobodny i nieoczywisty sposób oraz dobór gości - na płycie pojawią się m.in. Białas, Quebonafide, Paluch, Beteo i Zui.\nKontrowersyjna koncepcja, aby wpisać siebie w samobójczy \"Klub 27\" to ryzykowne balansowanie na granicy, które posłużyło jako punkt wyjścia do dyskusji o tym dokąd zmierza marketing w przemyśle muzycznym i atencyjność w social media. Motyw \"kryzysu na szczycie\" w połączeniu z niezwykle ambicjonalnym podejściem do wyczekiwanego projektu zaowocowały ostrym, odważnym i kontrowersyjnym obrazem pokolenia ludzi zagubionych w rzeczywistości XXI wieku. Już 8 grudnia będziecie mogli zajrzeć do głowy Solara i przekonać się co się w niej tak naprawdę kryje.\nSolar o \"Klub 27\": \"Aktorka zagrała ostrzejszą scenę łóżkową, taką wiecie, jak w filmach offowych. Trochę podniecającą, trochę obrzydliwą, trochę wściekłą, trochę namiętną, trochę dziką.\nPełne kino, premierowy seans. Wie, że już za parę sekund rozpocznie się TA właśnie scena. Fotel obok niej, wpatrzona w ekran siedzi jej niespodziewająca niczego się mama.\nDziś czuję się dokładnie jak ta aktorka. Jakbym totalnie opuścił gardę. Ta płyta jest szczera, brudna, przepełniona niecenzurowaną treścią, którą musiałem z siebie wylać\".\nTRACKLISTA:\n1. kękevlar intro2. kevlar3. wstyd4. klub 275. neuron (ft. białas)6. diREcTOr\'s cut7. ostatni snap (ft. quebonafide)8. kod pin9. jeszcze polska (ft. paluch)10. spinner11. granat12. god mode (ft. beteo)13. amy (ft. zui)14. dziękuję za uwagę', '', 'solar-klub-27-prod-deemz', '', '', '', 'solar - klub 27 (prod. deemz)', '', '', '', ''),
(139, 1, 1, 'Solar: \"Pracując nad poprzednim projektem \"Klub 27\" mocno wgłębiałem się w biografie artystów, którzy do tego klubu dołączyli. Wśród nich był Jim Morrison. Bardzo inspirowała go postać Aldousa Huxleya, autora książki \"Drzwi Percepcji\". Drzwi te symbolizowały pewne przejście w umyśle między świadomością, a podświadomością  i według teorii Aldousa w normalnych warunkach te drzwi są zupełnie zamknięte lub co najwyżej lekko uchylone i niewiele przez nie widać. Istnieją natomiast pewne sposoby, żeby je uchylić i zobaczyć nieco więcej, więc niesiony ciekawością postanowiłem zobaczyć co tam jest.\"\n\"Walt Disney miał taką metodę, która polegała na tym, że dzielił pracę na kilka etapów, nazywanych pokojami. Pokój pierwszy to był pokój, w którym latały najbardziej nieokrzesane i najbardziej spontaniczne pomysły i dopiero w kolejnych pokojach nabierały one konkretnej formy, bądź też były odrzucane.\nPrzy tym projekcie zależało mi na tym, żeby złapać właśnie te pierwsze, najbardziej spontaniczne i naturalne wrażenia, ale żeby coś mogło pojawić się w pokoju 1, najpierw musi pojawić się w wyobraźni. I to właśnie jest \"Pokój Zero\".\"\n-----------\nTracklista:\n01. 1051302. Berghain03. Jestem zdrowy (feat. Bedoes)04. Fuego05. Final Call06. Obłęd07. Dom08. Vantablack (feat. Szpaku)09. Syntetyczny Bóg (feat. Gverilla)10. BIPOLAR $$$HIT11. Chleba bezglutenowego i igrzysk12. The Good Place (feat. Miyo)13. Know-how (feat. Holak)14. Zobaczymy (feat. KACPERCZYK, MATA, Jan-Rapowanie)15. Papugi zielone\nProjekt okładki: Grzegorz \'Forin\' PiwnickiIlustracje: Dominik UrbańskiZapraszamy do Pokoju Zero.\nSłuchaj w cyfrze', '', 'solar-pokoj-zero', '', '', '', 'Solar - Pokój Zero', '', '', '', ''),
(140, 1, 1, 'Solar/Białas - #nowanormalnosc (1CD)\n\n #nowanormalnosc opowiada o rzeczywistości pokolenia Y, reprezentowanego przez autorów krążka. Raperzy poruszają na nim tematy natury egzystencjalnej, nie stroniąc momentami od analizy socjologicznej wybranych postaw i zachowań \"milenialsów\". Na krążku nie zabraknie także soczystych bangerów, z których słyną reprezentacji SB Maffiji. \n\nGrafiki i książeczka, będąca integralną częścią wydawnictwa to dzieło Lisa Kuli. Wydawnictwo: audiobook.\n\nKomentarz Solara i Białasa:\n- Długo zeszło nam się od premiery „Stage Divingu” do nagrania kolejnego Solar/Białas, bo ponad 3 lata. Podeszliśmy do robienia tej płyty tak jak zawsze do naszych wspólnych tzn:  wspólne kawałki które nagrywaliśmy w międzyczasie dzieliliśmy na te luźniejsze, bardziej spontaniczne i te bardziej przemyślane. Luźniejsze już dobrze znacie, a te bardziej przemyślane trafiły na płytę. Kluczem tekstowym do wszystkich kawałków była tytułowa „Nowa Normalność”, na którą składają się chociażby zrośnięte z rękami telefony, ludzie wyglądający jak rzeźby, vlogerzy, blogerki, samotni, zagubieni w rzeczywistości trzydziesto latkowie czy melanżujący do zgonu gimnazjaliści. \n\nW społeczeństwie zachodzą bardzo dynamiczne zmiany i wszyscy jesteśmy ich obserwatorami, o tym jest ta płyta.\n\nJeśli chodzi o muzykę skorzystaliśmy ze wszystkich najmocniejszych kontaktów jakie udało nam się wypracować przez lata. Matheo, Sherlock, SoDrumatic, DrySkull, Deemz, Czarny HIFI - to ksywki które mówią same za siebie. Jest lotnie, lekko i mainstreamowo.\n\nCD 1: 01. H8ME (prod. Dry Skull, skrecze DJ Flip)02. Młodzi, Piękni, Zepsuci (prod. Sher7ock, ft. Zui)03. Selfiestick (prod. SoDrumatic)04. Byliśmy pyłem gwiazd (prod. Sher7ock, ft. Zui)05. Na piasku (prod. SoSpecial, ft. Wac Toja)06. 0 PLN (prod. Wezyr, ft. Beteo)07. Nie dla Ciebie (prod. 101 Decybeli, ft. Wac Toja)08. Różowe okulary (prod. Deemz, ft. Zui)09. Banały (prod. Dry Skull)10. Gniazda (prod. Bob Air)11. Miliony szeptów (prod. Matheo, ft. Zui)12. A do Z (prod. Lenzy)13. Ziomek (prod. Deemz, ft. Bedoes)14. Nowa Normalność (prod. ka-meal)', '', 'solar-bialas-nowanormalnosc-wersja-1cd', '', '', '', 'Solar/Białas -  nowanormalnosc (wersja 1CD)', '', '', '', ''),
(141, 1, 1, 'Oficjalny t-shirt promujący najnowszą epkę Adiego Nowaka - Nienajseksowniejsze EP.Nadruki wykonane zostały metodą sitodruku.Z tyłu na dole metka żakardowa.100% najlepszej jakości bawełna.Wyprodukowano w Polsce.\n\nRozmiarXSSMLXLXXLDługość całkowita707275798285Szerokość pod pachami485052555860', '', 't-shirt-adi-nowak-nienajseksowniejsze-ep-black', '', '', '', 'T-shirt Adi Nowak - Nienajseksowniejsze EP Black', '', '', '', ''),
(142, 1, 1, 'Oficjalny t-shirt projektu Moli - Jak spadały gwiazdy.\nKrój oversize.\nNadruki wykonane metodą sitodruku.\n100% najlepszej jakości bawełna.\nGramatura - 180g/m2\nWyprodukowane w Polsce.\n\nRozmiarSMLXLXXLDługość całkowita6466687072Szerokość pod pachami7072747678', '', 't-shirt-moli-moon-white', '', '', '', 'T-shirt Moli Moon White', '', '', '', ''),
(143, 1, 1, '“Marmur” jest słuchowiskową rap płytą powstałą dzięki kolaboracji rapera Filipa Szcześniaka i producenta Rumaka. Jej bohater, enigmatycznie nazwany SZCZEŚNIAKIEM, zostaje wbrew swojej woli zameldowany w tajemniczym trójmiejskim hotelu “Marmur”. Na miejscu dowiaduje się, że stoi przed nim ogrom pracy, choć nikt nie mówi mu na czym ma ona polegać. Niestety jego początkowy spokój ducha zostaje roztrzaskany przez obecność złowrogiego brodacza, z którym dzielił przedział w pociągu relacji Warszawa Trójmiasto.\n1. Marmur  2. Witaj w Hotelu Marmur  3. Żyrandol  4. Krwawa jesień  5. Grubo-chude psy  6. Portier!  7. Mgła I (Siwe włosy)  8. Mgła II (Mówisz, masz)  9. Świat jest WFem  10. Świecące prostokąty  11. Tsunami blond  12. Ślepe sumy  13. Żywot  14. Ściany mają uszy  15. Jak cień  16. To by było na tyle  17. Deszcz na betonie (?)', '', 'taco-hemingway-marmur', '', '', '', 'Taco Hemingway - Marmur', '', '', '', ''),
(144, 1, 1, '\"To wszystko dziełem przypadku\"…\"Jeszcze na początku maja pisałem zupełnie inną płytę. Obiecałem sobie, że tym razem dam sobie tyle czasu, ile będzie trzeba. Zapowiedziana na rok 2019 przerwa wydawnicza miała być więc wymogiem logistycznym. Okazało się jednak, że jestem uzależniony od wydawania nowego materiału w lato. Cóż począć. I tak właśnie powstała \"Pocztówka\". Po roku 2018, erze silnego skupiania się na sobie (\"SOMA\" + \"Café Belga\" + \"Flagey\"), czas wymienić lustro na teleskop i wrócić do obserwowania miasta i społeczeństwa. Żeby jednak zadowolić ten segment słuchaczy, który lubi posłuchać sobie moich mniej lub bardziej zrytmizowanych neurotyzmów, postanowiłem dać im upust w stuwersowych \"Kabrioletach\" zamykających standardową wersję płyty. Pierwszy raz w życiu w swoich działaniach solowych zdecydowałem się zaprosić na płytę kilku gości, i to dość zróżnicowanych pod kątem muzycznym i osobowościowym.Jako że nic mnie tak nie mierzi jak mitologizacja poetów, muzyków i artystów, powiem to najprościej jak się da: przed tobą znajduje się seria dźwięków i garść obserwacji. Tylko i aż tyle.Nie jest to rozprawka ani reportaż. Nie jest to esej ani epopeja. Nie jest to manifest, memoir ani moralitet. Jest to pocztówka. Oto kilka opowieści z Warszawy. Ode mnie, dla was. Niechaj umili wam to kolejne burzliwe lato\" - mówi artysta.\nTrack lista:\n01. Człowiek Z Dziurą Zamiast Krtani02. Antysmogowa Maska W Moim Carry-On Baggage Feat. Pezet03. Leci Nowy Future04. W Piątki Leżę W Wannie Feat. Dawid Podsiadło05. Wwa Vhs Feat. Ras06. Wytrawne (Z Nutą Desperacji)07. Wujek Dobra Rada08. Tijuana Feat. Kizo09. Sanatorium Feat. Dawid Podsiadło, Rosalie.10. Alert Rcb Feat. Schafter11. Kabriolety', '', 'taco-hemingway-pocztowka-z-wwa-lato-19', '', '', '', 'Taco Hemingway - Pocztówka z WWA, Lato \'19', '', '', '', ''),
(145, 1, 1, 'Najnowsza płyta z dyskografii Taco Hemingwaya.W środku znajdziecie nie tylko CD, ale także plakat oraz booklet!\nNostalgiaChodźTlenGłupi BytDeleI.S.W.T35Karimata (mute)Saldo \'07\nsłowa &amp; wokal: Filip Szcześniak \nmuzyka &amp; produkcja muzyczna: Rumak z wyjątkiem 2. Zeppy Zepp 6. Borucci 9. Duit\nmix &amp; mastering: Rafał Smoleń \nnagrania: Studio Nagrywarka \nprojekt okładki: Sonia Szóstak, Piotr Dudek, Łukasz Partyka \ntypografia: Mateusz Machalski', '', 'taco-hemingway-szprycer', '', '', '', 'Taco Hemingway - Szprycer', '', '', '', ''),
(146, 1, 1, 'Druga płyta Taco Hemingwaya to echo wielkomiejskich wątków stanowiących tło dla akcji \"Trójkąta warszawskiego\". Płytę promuje teledysk „6 zer”, a także znany z radiowej Trójki singiel \"Następna stacja”, będący zapisem przejażdżki stołecznym metrem. W sferze muzycznej klimatyczne podkłady Rumaka tworzą dopełniający się tandem z głosem i stylem Taco.\nTracklista:\n\"Od zera\"\"A mówiłem ci\"\"Następna stacja\"\"6 zer\"\"+4822\"\"Awizo\"\"Białkoholicy\"\"100 khm\"\nsłowa: Taco Hemingway\nmuzyka/produkcja: Rumak (z wyjątkiem piosenki \"+4822\" produkcji Borucci)\nokładka: Jonasz Tołopiło, Piotr Dudek, Łukasz Partyka\nremastering: Eprom Sound Studio', '', 'taco-hemingway-umowa-o-dzielo', '', '', '', 'Taco Hemingway - Umowa o dzieło', '', '', '', ''),
(147, 1, 1, 'Ten zbiór 6 utworów, nagranych w lipcu 2016, stanowi osobiste podsumowanie kariery Taco na kilka miesięcy przed wydaniem pierwszego pełnego albumu “Marmur\". Produkcją utworów podzielili się sprawiedliwie Rumak i Borucci.\nTracklista:\n01. WOSK02. BXL03. SZCZERZE04. WIATR05. 51506. KOŁA', '', 'taco-hemingway-wosk', '', '', '', 'Taco Hemingway - WOSK', '', '', '', ''),
(148, 1, 1, 'Pod koniec listopada 2011 do sprzedaży trafia reedycja pierwszej solowej płyty Mesa pt. „Alkopoligamia: zapiski typa”. Ten kultowy album przetrwał próbę czasu i mimo, że autor zdążył wielokrotnie zmienić styl od 2005 r., muzyka z tego okresu to wciąż ostre flow, emocje i świetne bity.Ceny używanych egzemplarzy osiągają od dawna zawrotne ceny na aukcjach, wytwórnia Alkopoligamia.com zdecydowała się więc zrobić z tym porządek. Dzięki wykupieniu praw do „…zapisków…” od oficyny T1/Teraz słuchacze Mesa będą mogli rozkoszować się doskonałym brzmieniem dwudziestu utworów z przeszłości i sześciu nowych tracków. Jak mówi Mes, nie są to odrzuty z „Kandydatów na szaleńców”, a nowe numery, nagrane z potrzeby podarowania fanom czegoś wyjątkowego.\nCD1 01 Intro02 ..Widzę szaleństwo / feat. Jeeż a.k.a. Ewing03 ..Strach..04 Wjaazd!05 Cygara i pety06 Dwa Światy07 Zdrada / feat. Rafał Gańko (Złodzieje Oklasków)08 _Stop! / feat. Piotr Pacak09 Sam siedzę tu..10 Ot tak11 Witaj Śmierci12 G-funk, jakbyś pytał / feat. 2cztery713 T-Y-P (definicja) / feat. Dj Twister14 Pił Żartem / Pił serio\nCD201 Krzyki za oknem (remix)02 Sam siedzę tu.. (live)03 ..Wyżeej..04 Jak to jest05 Nagła ŚmierćBONUS TRACKS 201106 Zrzutka / feat. Stasiak &amp; Głośny07 Dumny jak paw / feat. VNM08 Lecę do ciebie / feat. Hade (ZETENWUPE)09 Mogę odetchnąć / feat. Głośny10 Detoks11 Klocki', '', 'ten-typ-mes-alkopoligamia-zapiski-typa-2cd', '', '', '', 'Ten Typ Mes - Alkopoligamia: Zapiski Typa (2CD)', '', '', '', ''),
(149, 1, 1, 'Na najnowszej solowej płycie Mes zabierze słuchaczy w podróż między sceną festiwalu, a oglądaniem serialu, między pokusą wzięcia kredytu, a tworzeniem międzypokoleniowej piosenki w ciasnej kawalerce, między kupnem wymarzonego auta, a ścieraniem z czarnego lakieru ptasich odchodów.\n01. Codzienność (+Dawid Podsiadło) - muzyka: Michał Fox Król02. Mój terapeuta - muzyka: RAU03. Bledną - muzyka: RAU, Max Fiszer04. Book Please - muzyka: Wrotas Lifeview05. Pytajniki - muzyka: Max Fiszer06. Pokaż mi dom - muzyka: Night Marks Electric Trio07. Przewóz Osób - muzyka: Wrotas Lifeview08. Jak nikt - muzyka: Łukasz Kortez Federkiewicz09. Unisex - muzyka: Andrzej Fonai Pieszak10. Czy ty to ty? (+VNM) - muzyka: Mateusz Gudel11. Ale psa byś przytulił - muzyka: Bartosz Szogun Pietrzak12. W sumie nie różnią się? (+Ifi Ude) - muzyka: Michał Fox Król13. Świeżak (+RAU) - muzyka: Mateusz Holak14. Jeden mail - muzyka: Mariusz Obijalski15. Ride - muzyka: Wrotas Lifeview16. Nieiskotne (+Iza Lach) - muzyka: Andrzej Fonai Pieszak17. Zawsze mogę liczyć na - muzyka: Michał Tomaszczyk', '', 'ten-typ-mes-ala', '', '', '', 'Ten Typ Mes - Ała', '', '', '', ''),
(150, 1, 1, '01. ODPORNOŚĆ feat. Justyna Święs muzyka: Piotr Szmidt, Jose Manuel Alban Juarez02. KRZYCZAŁ NA SYNKA muzyka: Piotr Szmidt, Ola Trzaska03. MODA NA PALENIE SZISZY muzyka: Piotr Szmidt, Krzysztof Kawałko04. KULE Z BUKSZPANU muzyka: Piotr Szmidt05. NIE BĄDŹ KURWĄ muzyka: Piotr Szmidt06. ZIMA feat. Głośny muzyka: Piotr Szmidt, Krzysztof Kawałko, Głośny07. P1ĘTR0 muzyka: Piotr Szmidt08. 100 WYMÓWEK muzyka: Piotr Szmidt09. JESZCZE [FLEXXIP] muzyka: Piotr Szmidt10. PO TĘ TU muzyka: Piotr Szmidt11. HOŁD UP muzyka: Piotr Szmidt12. UNDERGOUND POLAND muzyka: Piotr Szmidt13. DAWAJ NA STACJĘ muzyka: Piotr Szmidt14. NIE BUJAJ SIĘ NA KRZEŚLE muzyka: Piotr Szmidt15. WYGLĘDÓW muzyka: Piotr Szmidt, Michał Tomaszczyk16. RUDY KURNIAWAN muzyka: Piotr Szmidt', '', 'ten-typ-mes-rapersampler', '', '', '', 'Ten Typ Mes - Rapersampler', '', '', '', ''),
(151, 1, 1, 'Druga solowa płyta Mesa dostarczyła sporo przełomowych utworów – od nagranego na ulicy „My”, przez imprezowe „Jak to?!” po refleksyjne „25″ czy „Smak życia”. Raper pierwszy raz dopuścił się eksperymentu z punk rockiem hałasując w „OiOMie”.Ten Typ Mes dostarczył album pełen wątpliwości w siebie, świat oferujący szablonowe rozwiązania i moc pieniądza – nie zwątpił jednak w dojrzałość odbiorców i umiejętność pisania piosenek dla nich.\n01 Cześć (intro)02 Ten zwykły we mnie03 To już04 Nie ten sam ziom feat. Numer Raz, Łona05 Jak to !?06 Nie płaczę za nimi feat. Ero, Stasiak07 Na później (skit)08 Welcome/Willkommen!09 Tribute to Hank (skit)10 Smak życia11 Dwadzieścia pięć feat. K812 Kontrkultura (skit)13 My14 Zamach na Jana K.15 Giń, kochanie ! feat. Flow, Riczi16 OiOM17 Dziś nie zamierzam kochać (skit)18 Co jest warte uwagi', '', 'ten-typ-mes-zamach-na-przecietnosc', '', '', '', 'Ten Typ Mes - Zamach na przeciętność', '', '', '', ''),
(152, 1, 1, '\"Klaud N9jn\" to czwarta solowa, a pierwsza koncepcyjna płyta VNM-a - raper wykorzystuje sny jako bazę do opowiedzenia historii swojego życia widzianej oczami mniej lub bardziej bliskich mu osób. Produkcją muzyczną albumu zajęli się m.in. B.Melo, Czarny HIFI, DrySkull, Du:it, Sherlock, SoDrumatic i inni. Gości ujawnimy wkrótce. Okładka płyty \"Klaud N9jn\" to dzieło Bartka Kotera, który namalował obraz widoczny na froncie, oraz Karola Rycio odpowiedzialnego za oprawę graficzną.Pierwszym singlem promującym nowy materiał VNM-a jest klip do utworu \"Druga\" z gościnnym udziałem Sylwii Dynek.Track lista:\n01. Dziewiąta chmura02. Skalpel03. Druga04. HopeUKnow05. REM06. Izolacja07. Kent stej08. Zmora09. Chcę to widzieć10. Barman11. Zagłusz mnie12. Najtaut13. Mirror ErroR', '', 'vnm-klaud-n9jn', '', '', '', 'VNM - Klaud N9jn', '', '', '', ''),
(153, 1, 1, '\"ProPejn\" to trzeci oficjalny album VNM-a. Zawiera 13 nowych nagrań, z których 3 są już znane publiczności jako single: \"Hajs się zgadza\", \"Szempejn papyn\" oraz teledyskowy \"Obiecaj mi\" z goścnnym udziałem Tomsona z Afromental. Pozostałymi gośćmi na albumie jest dwójka innych elbląskich przyjaciół rapera: Kamila Bagnowska, która śpiewa w jednym z numerów, oraz raper Flojd.Jedynym \"ojcem\" muzycznej warstwy płyty jest SoDrumatic, który odpowiada za brzmienie całości.Jakiego albumu możecie się spodziewać? Na pewno dobrego, ale, jak mówi sam VNM, \"Zamiast pisać o mojej płycie, wolę poczekać na moment, w którym sami wrzucicie ją na słuchawki, przesłuchacie od początku do końca i podzielicie się ze mną wrażeniami\".\nTrack lista:\n1. Zawada 2k13 feat. Flojd2. Hajs się zgadza3. Zapiekanki4. ProPejn5. Fan 26. Spejsszyp feat. Kamila Bagnowska7. Obiecaj feat. Tomson8. Reintrospekcja9. Znów dobrze10. Szempejn papyn11. Bipolar12. A kiedy13. Blizna', '', 'vnm-propejn', '', '', '', 'VNM - Propejn', '', '', '', ''),
(154, 1, 1, 'Legalny debiut Wac Toja w odświeżonej wersji!\"High Quality\" to zdecydowanie pozycja dla najbardziej wymagających entuzjastów nowego brzmienia rapu. W wersji podstawowej album został niemal wyprzedany, a reedycja zaskoczy Was nie tylko całkowicie nową, bogatą w uszlachetnione detale poligrafią, ale również premierowym materiałem muzycznym 01. Rzucić Rap ft. Białas (prod. TEF x TOJA)02. Klej (prod. Jacon)03. Perfekt (prod. SecretRank)04. EJ EJ EJ (prod. Adash)05. Pranie mózgu (prod. TOJA)06. Czasem (prod. MYSTXRIVL)07. Show W... (prod. Kubi Producent x GeezyBeatz) 08. Spotkałem Anioła ft. Rivkah Hope (prod. Fast Life Sharky x TOJA)09. Budzę Się (prod. HVZX)10. Spięcia Luzy (prod. Worek)11. Aloes ft. Quebonafide (prod. M1CKY)12. Labirynt (prod. AIST)+ bonus muzyczny do odkrycia po otrzymaniu albumu', '', 'wac-toja-high-quality-reedycja', '', '', '', 'Wac Toja - High Quality (Reedycja)', '', '', '', ''),
(155, 1, 1, 'Po niekwestionowanym sukcesie debiutanckiego albumu “Rockstar”, który uplasował go w czołówce najpopularniejszych polskich raperów i niedługo po premierze pokrył się złotem, White 2115 powraca z nowym materiałem.\n“Młody Książę” to dziewiętnaście starannie wyselekcjonowanych i spójnych brzmieniowo utworów. White zaprasza nas do świata szybkich samochodów, drogich ubrań i pięknych kobiet kontrastujących z samotnością, uzależnieniami i celebryckim blichtrem. To świat, w którym sukces od porażki potrafią dzielić sekundy.  \nTak jak przy pierwszej płycie, White zaprosił do współpracy zarówno polskich, jak i zagranicznych producentów. Udało im się stworzyć unikatową mieszankę trapu i elektroniki i sprawić, że projekt zyskał własne charakterystyczne brzmienie. Na albumie nie zabrakło również gości - gospodarza swoimi zwrotkami wsparli czołowi przedstawiciele polskiej sceny rapowej.\n      Tracklista:\nFleszTriple SGTRPałacMłody książęTrzy butelki+(48) ft. Jan-rapowanieDMCByliśmy tuNa zawszeNie chcęAMG ft. Malik Montana &amp; Pablo 2115D.evilJohn travolta ft. ŻabsonM550i ft. PlanBWampirRok ft. Kuqe 2115', '', 'white-2115-mlody-ksiaze', '', '', '', 'White 2115 - Młody Książę', '', '', '', ''),
(156, 1, 1, 'White 2115 to śmiała indywidualność i  pierwsza gwiazda rocka w polskim hip-hopie. Mimo młodego wieku (rocznik 1996) pochodzący z Milanówka reprezentant 2115 Gang w szybkim tempie zdobył uznanie słuchaczy. Przekraczając wszelkie granice stworzył album “Rockstar” łączący trapowe bengery z niemal rockowymi balladami. Wszechstronność White’a doprowadziła do współpracy z SB Maffiją, a udział w akcji SB Starter okazał się skuteczną drogą do pierwszego profesjonalnego kontraktu. W 2018 na kanale wytwórni pojawił się jego  singiel “California”, który w dwa miesiące zdobył ponad 12 milionów odsłon. W tym samym roku White został wybrany Młodym Wilkiem portalu Popkiller, co skupiło na nim jeszcze większą uwagę odbiorców i hip-hopowego środowiska. Jego koncerty, sceniczny wizerunek i energia, którą dzieli się ze słuchaczami, sprawiają, że nie można przejść obok niego obojętnie. Świeże i ekscytujące dźwięki albumu “Rockstar” otwierają kolejny rozdział jego niezwykłej kariery. Gościnnie na krążku pojawili się: Białas, Bedoes i Kuqe.\nTracklista:\n01. Balmain (prod. LexNour)02. Kurt Cobain (prod. Got Barss)03. California (prod. Imotape Productions)04. Jaki ojciec taki syn (prod. Imotape Productions)05. Rockstar (prod. Deemz)06. La Vida Loca (prod. ATP Beats)07. Noc (prod. Kuroime)08. Anioł stróż (prod. Deemz)09. Jim Morrison (prod. Deemz)10. Cry Baby (prod. Deemz)11. Nowi kumple ft. Bedoes, Kuqe (prod. MajinSauce)12. Sos mula ft. Białas (prod. Deemz)13. Sen (prod. Kubi Producent)14. Legenda (prod. Masked Man)', '', 'white-2115-rockstar', '', '', '', 'White 2115 - Rockstar', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(157, 1, 1, 'LIMITOWANY NAKŁAD \"MATI WIATR\" DOSTĘPNY JEDYNIE NA WWW.SBMSTORE.PLNAKŁAD LTD: 500 sztuk\nPREMIERA PŁYTY: 10 LISTOPADA 2017\nPo\nkilkunastu miesiącach współpracy z SB Maffija Label i kilkunastu\npremierach na kanale SBM, Wiatr prezentuje swój pierwszy materiał\nwydany nakładem wytwórni. To był bardzo owocny rok, a takie\nkawałki jak \"Wschód i Zachód\", \"Halloween\",\n\"Mati Wiatr\" czy \"Deja Vu\" okazały się\npierwszymi ogólnopolskimi hitami w dorobku 21-letniego rapera z\nKrakowa. Ukoronowaniem wielomiesięcznej pracy gruntującej pozycję\nWiatra na scenie będzie oficjalna premiera albumu \"Mati Wiatr\".\nMati\nzwrócił na siebie uwagę doskonałym drygiem to pisania melodii,\nktóre z naturalną łatwością generują potencjalne przeboje.\nCharakterystyczna barwa głosu, wysokiej klasy rapowe skillsy i\nponadprzeciętne umiejętności wokalne sprawiły, że Wiatr stał\nsię jednym z najbardziej obiecujących postaci młodego pokolenia, a\nna jego koncertach refrenowe melodie śpiewają całe sale. Zwycięzca\nkonkursu OUTFEAT, który otworzył mu drzwi do współpracy z\nwytwórnią, ma również nieprzeciętne ucho do bitów - na jego\npłycie usłyszeć można znakomite produkcje młodego pokolenia\nbeatmakerów takich jak Michał Graczyk, Fliptunes, Mienski czy Faded\nDollars.\n\"Mati\nWiatr\" to album na którym będzie można usłyszeć wszystkie\nnajpopularniejsze kawałki Wiatra, a także premierowe numery\nprzygotowane specjalnie z myślą o tej płycie. KOOZA odpowiedzialny\nza najlepsze teledyski rapera zadbał również o oprawę graficzną\nkrążka, który ukaże się już 10 listopada 2017. \n\nTRACKLISTA:\n1. Wschód i Zachód (Prod. Feliepe)2. Lazy (Prod. Unknown)3. Świętość (Prod. Chdzk.Crvcrz)4. Zapisz Jako (Prod. K4m)5. Beverly Hills (Prod. Kowal)6. W idealnym Świecie (Prod. Faded Dollars)7. Tasiemiec (Prod. Flame)8. Deja Vu (Prod. Michał Graczyk)9. Mati Wiatr (Prod. FlipTunes)10. Blues (Prod. Mienski)11. Route 66 (Prod. FlipTunes)12. Halloween (Prod. Mienski)13. Bomby (Prod. Michał Graczyk x Mienski)\nBonus track:\n14. Bez Analiz (prod. Michał Graczyk)', '', 'wiatr-mati-wiatr', '', '', '', 'Wiatr - MATI WIATR', '', '', '', ''),
(158, 1, 1, '<p><span style=\"color:#2c3238;font-family:Roboto, sans-serif;font-size:13px;background-color:#ffffff;\">W ramach akcji “Sekcja Ratowania Życia” realizowanej we współpracy z Fundacją DKMS przygotowaliśmy dedykowany pakiet dawcy szpiku. Możesz dodać go bezpłatnie do każdego produktu zamówionego w SBM Store, w tym do preorderów naszych albumów. Zamówienie i wypełnienie pakietu oraz, co najważniejsze, odesłanie go na adres Fundacji DKMS poprzez wrzucenie do najbliższej skrzynki pocztowej umożliwi ci dołączenie do bazy dawców szpiku, zostanie potencjalnym dawcą i być może uratowanie życia osobie chorej na nowotwór krwi. Cały proces jest prosty, szybki, bezpłatny i bezbolesny.</span><br style=\"color:#2c3238;font-family:Roboto, sans-serif;font-size:13px;background-color:#ffffff;\" /><br style=\"color:#2c3238;font-family:Roboto, sans-serif;font-size:13px;background-color:#ffffff;\" /><span style=\"color:#2c3238;font-family:Roboto, sans-serif;font-size:13px;background-color:#ffffff;\">Dedykowany pakiet dawcy zawiera:</span></p>\n<ul style=\"margin:1em 0px;padding:0px 0px 0px 40px;border:0px;font-size:13px;background:#ffffff;color:#2c3238;font-family:Roboto, sans-serif;\">\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">list powitalny</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">instrukcję wypełnienia formularza i pobrania wymazu</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">pałeczki wymazowe do pobrania wymazu z wewnętrznej strony policzka</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">formularz rejestracyjny</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">ulotkę</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">kopertę zwrotną</li>\n<li style=\"margin:0px;padding:0px;border:0px;background:transparent;line-height:20px;\">naklejkę</li>\n</ul>\n<p style=\"margin:1em 0px;padding:0px;border:0px;font-size:13px;background:#ffffff;color:#2c3238;font-family:Roboto, sans-serif;\"><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\"><br />UWAGA! Zamówienie i odesłanie pakietu jest całkowicie darmowe, a pobranie wymazu z wewnętrznej strony policzka zupełnie bezbolesne. Kopertę zwrotną zawierającą pałeczki wymazowe i podpisany formularz rejestracyjny wystarczy wrzucić do dowolnej skrzynki pocztowej.</span><br /><br />Dołącz do Sekcji Ratowania Życia i zwiększ szanse osób chorych na nowotwory krwi na odnalezienie swojego “bliźniaka genetycznego”!<br /><br /><span style=\"margin:0px;padding:0px;border:0px;background:transparent;font-weight:bold;\">Wysyłka zamówień z dodanymi pakietami dawcy szpiku i niezawierających preorderów odbywa się na bieżąco.</span></p>', '', 'pakiet-dawcy-szpiku', '', '', '', 'Pakiet Dawcy Szpiku', '', '', '', ''),
