INSERT INTO `ps_translation` (`id_translation`, `id_lang`, `key`, `translation`, `domain`, `theme`) VALUES
(1, 1, 'View %error_count% error logs', 'Wyświetl %error_count% dzienniki błędów', 'AdminActions', NULL),
(2, 1, 'The value of the PHP.ini setting \"max_input_vars\" must be increased to %value% in order to be able to submit the product form.', 'Wartość ustawienia PHP.ini \"max_input_vars\" musi być zwiększona do %value%, aby można było przesłać formularz produktu.', 'AdminNotificationsError', NULL),
(3, 1, 'This order status does not exist.', 'Ten status zamówienia nie istnieje.', 'AdminNotificationsError', NULL),
(4, 1, 'The selected condition must be different in each field to set an order of priority.', 'Wybrany warunek musi być inny w każdym polu, aby ustawić kolejność.', 'AdminNotificationsError', NULL),
(5, 1, 'Use default order: [1]{priority_list}[/1]', 'Użyj domyślnej kolejności: [1]{priority_list}[/1]', 'AdminCatalogFeature', NULL),
(6, 1, 'Set a specific order for this product', 'Ustaw konkretne zamówienie dla tego produktu', 'AdminCatalogFeature', NULL),
(7, 1, 'Label when out of stock (and backorders allowed)', 'Etykieta, gdy nie ma w magazynie (i dozwolone są zamówienia zwrotne)', 'AdminCatalogFeature', NULL),
(8, 1, 'Default order of priority for specific prices', 'Domyślna kolejność priorytetów dla poszczególnych cen', 'AdminShopparametersFeature', NULL),
(9, 1, 'Set the order as in transit.', 'Ustaw zamówienie jako w tranzycie.', 'AdminShopparametersFeature', NULL),
(10, 1, 'A word by itself is easy to guess', 'Słowo samo w sobie jest łatwe do odgadnięcia', 'AdminAdvparametersFeature', NULL),
(11, 1, 'Disable non built-in modules', 'Wyłączenie modułów niewbudowanych', 'AdminAdvparametersFeature', NULL),
(12, 1, 'Read the [1]developer documentation[/1].', 'Przeczytaj [1]dokumentację deweloperską[/1].', 'AdminAdvparametersFeature', NULL),
(13, 1, 'It seems that the webservice endpoint is not functional. If you are using httpd/apache2, you need to enable URL rewriting on your server.', 'Wygląda na to, że punkt końcowy webservice nie działa. Jeśli używasz httpd/apache2, musisz włączyć przepisywanie adresów URL na swoim serwerze.', 'AdminAdvparametersFeature', NULL),
(14, 1, 'Webservice is enabled. Main entry point is', 'Usługa Webservice jest włączona. Główny punkt wejścia to.', 'AdminAdvparametersFeature', NULL),
(15, 1, 'Webservice status', 'Status usługi internetowej', 'AdminAdvparametersFeature', NULL),
(16, 1, '4 is very unguessable (guesses greater than or equal to 10^10) and provides strong protection from offline slow-hash scenario.', '4 jest bardzo nieodgadniony (zgadywanie większe lub równe 10^10) i zapewnia silną ochronę przed scenariuszem offline slow-hash.', 'AdminAdvparametersFeature', NULL),
(17, 1, '3 is safely unguessable (guesses lesser than 10^10). It offers moderate protection from offline slow-hash scenario.', '3 jest bezpiecznie nieodgadniony (zgadywanie mniejsze niż 10^10). Oferuje umiarkowaną ochronę przed scenariuszem offline slow-hash.', 'AdminAdvparametersFeature', NULL),
(18, 1, '2 is pretty easy to guess (guesses lesser than 10^8). It provides some protection from unthrottled online attacks.', '2 jest dość łatwy do odgadnięcia (zgadywanie mniejsze niż 10^8). Zapewnia to pewną ochronę przed nieretuszowanymi atakami online.', 'AdminAdvparametersFeature', NULL),
(19, 1, '1 is still very easy to guess (guesses lesser than 10^6). An extra character on a dictionary word can score 1.', '1 jest nadal bardzo łatwe do odgadnięcia (zgadnięcia mniejsze niż 10^6). Dodatkowy znak na słowie słownikowym może dać wynik 1.', 'AdminAdvparametersFeature', NULL),
(20, 1, '0 means the password is extremely easy to guess (within 10^3 guesses). Dictionary words like \"password\" or \"mother\" score 0.', '0 oznacza, że hasło jest niezwykle łatwe do odgadnięcia (w granicach 10^3 zgadnięć). Słowa słownikowe takie jak \"hasło\" lub \"matka\" otrzymują 0 punktów.', 'AdminAdvparametersFeature', NULL),
(21, 1, 'Password policy', 'Polityka dotycząca haseł', 'AdminAdvparametersFeature', NULL),
(22, 1, 'Clear', 'Jasne', 'AdminAdvparametersFeature', NULL),
